INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(1, 1, 'GDR250LT  Lietuvos Respublikos teritorijos M 1:250 000 georeferencini erdvini duomen rinkinys', '2024-03-14', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:250 000 georeferencini erdvini duomen rinkinys (sutrumpintas pavadinimas  GDR250LT) yra valstybinis erdvini duomen rinkinys, kuriame kaupiami ems paviriaus gamtini ir antropogenini objekt, esani Lietuvos Respublikos teritorijoje duomenys.  erdvin duomen rinkin sudaro erdviniai objektai susij su vandens telkiniais, ems danga, transporto tinklu, ininerinmis komunikacijomis, geodeziniais punktais, reljefu, vietovardiais, administracini vienet ir saugom teritorij ribomis, ir pan.e', 'https://data.gov.lt/datasets/548/'),
(2, 1, 'Lietuvos Respublikos teritorijos M 1:50 000 georeferencini erdvini duomen rinkinys GDR50LT', '2024-03-14', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:50 000 georeferencini erdvini duomen rinkinys (sutrumpintas pavadinimas  GDR50LT) yra valstybinis erdvini duomen rinkinys, kuriame kaupiami ems paviriaus gamtini ir antropogenini objekt, esani Lietuvos Respublikos teritorijoje duomenys.  erdvin duomen rinkin sudaro erdviniai objektai, susij su vandens telkiniais, ems danga, transporto tinklu, ininerinmis komunikacijomis, geodeziniais punktais, reljefu, vietovardiais, administracini vienet ir saugom teritorij ribomis, ir pan.', 'https://data.gov.lt/datasets/2561/'),
(3, 1, 'Lietuvos Respublikos teritorijos geografini vietovardi erdvini duomen rinkinys GV_DRLT', '2024-03-13', '2024-03-14', 'LR teritorijos geografini vietovardi erdvini duomen rinkinyje (GV_DRLT) kaupiama informacija apie geografini objekt viet emlapyje ir t objekt pavadinim (pavadinimo rayb, gramatin informacij, vietovardio kilms aikinim). GV_DRLT duomen rinkinys sukurtas naudojant duomenis, gautus i i duomen teikj: Lietuvi kalbos instituto, Valstybins saugom teritorij tarnybos, Kultros paveldo departamento, Lietuvos automobili keli direkcijos, Nacionalins ems tarnybos, Etnins kultros globos tarybos, Lietuvos geologijos tarnybos, Lietuvos TSR aukiausiosios tarybos prezidiumo (GV_DRLT papildymui 1940-1990 m. panaikint gyvenviei vietomis ir pavadinimais), geoportal.lt naudotoj, Instytut badan spraw narodowosciowych (Lenkija).', 'https://data.gov.lt/datasets/2560/'),
(4, 2, 'ANK 45 str. paeidimai ir paeidjai', '2024-03-12', '2024-04-09', 'Administracini nusiengim registro (ANR) bylos, kuriose minimas Administracini nusiengim kodekso (ANK) 45 straipsnis (\"Visuomens sveikatos srities Europos Sjungos reglament ar sprendim, higienos normini akt ar kit visuomens sveikatos srities teiss akt, Lietuvos Respublikos moni ukreiamj lig profilaktikos ir kontrols statymo paeidimas\"). \r\n\r\nPateikiama neagreguota lentel (mikroduomenys). Viena eilut yra vieno administracinio nusiengimo vieno straipsnio vienos dalies vienas paeidjas. Detalizuojama demografin informacija apie paeidj bei paeidimo vietos aplinkybes.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.\r\n\r\nANK 45 straipsnio dalys:\r\n1. paeidimas;\r\n2. paeidimas, padarytas pakartotinai;\r\n3. paeidimas, kuomet veikos sukl pavoj iplisti pavojingoms ar ypa pavojingoms ukreiamosioms ligoms;\r\n4. paeidimas, kuomet veikos, suklusios pavoj iplisti pavojingoms ar ypa pavojingoms ukreiamosioms ligoms, padarytos karo, nepaprastosios padties, mobilizacijos, karantino, riboto karantino metu, taip pat susidarius ekstremaliajai situacijai ar ekstremaliajam vykiui, jeigu ekstremalioji situacija ar ekstremalusis vykis kelia pavoj moni gyvybei ar sveikatai.', 'https://data.gov.lt/datasets/2558/'),
(5, 3, 'Savivaldybs turto, iskyrus nekilnojamj turt, panaudos sutartys', '2024-03-06', '2024-03-06', 'Savivaldybs turto, iskyrus nekilnojamj turt, panaudos sutartys 2024 met pradioje', 'https://data.gov.lt/datasets/2554/'),
(6, 3, 'Valstybini brandos  egzamin rezultatai', '2024-03-06', '2024-03-06', '3 paskutini met valstybini brandos egzamin rezultatai', 'https://data.gov.lt/datasets/2552/'),
(7, 4, 'Pajam pasiskirstymo koeficientas S80/S20', '2024-03-06', '2024-03-06', 'Metin vis Lietuvos privai nam ki ir nuolatini Lietuvos gyventoj statistin informacija apie asmen, kuri ekvivalentins pinigins disponuojamosios pajamos yra penktojoje kvintilinje grupje, ir asmen,  kuri ekvivalentins pinigins disponuojamosios pajamos yra pirmojoje kvintilinje grupje, santyk pagal regionus nuo 2009 m. bei pagal ami ir lyt nuo 2021 m. Naudojami LR Administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018) ir Bendras teritorini statistini vienet klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2555/'),
(8, 5, 'e. Recepto posistems duomenys apie vaistini iduotus receptinius vaistus', '2024-03-05', '2024-03-08', 'e.Sveikatos (ESPBIIS) e.Recepto posistems duomenys apie vaistini iduotus, pagal gydytojo recept paskirtus, vaistus.  \r\nTerminas VAISTAS iame duomen rinkinyje naudojamas kaip bendrinis pavadinimas visiems su receptu skiriamiems medicininiams produktams (vaistinis preparatas, medicinos pagalbos priemon (MPP), vardinis vaistas, ekstemporalus vaistas, kitos priemons).\r\n\r\nDuomen nuasmeninimo kriterijai:\r\n1. Jeigu per ketvirt vienam TLK-10-AM kodui irayt recept skaiius yra maesnis nei 10, duomen rinkinyje pateikiamas tik dirbtinis irayto recepto identifikatorius, recepto iraymo metai bei ketvirtis ir diagnozs (TLK-10-AM klasifikatoriaus), pagal kuri iraytas receptas, kodas bei pavadinimas.\r\n2. Jeigu per ketvirt vienam TLK-10-AM kodui vienoje savivaldybje, kurioje yra recept iraiusi gydymo staiga, irayt recept skaiius yra maesnis nei 5, staigos, kurioje buvo iraytas receptas, savivaldyb nenurodoma.\r\n3. Jeigu per ketvirt vienam TLK-10-AM kodui vienoje savivaldybje, kurioje pacientas yra deklaravs gyvenamj viet, irayt recept skaiius yra maesnis nei 5, paciento deklaruotos gyvenamosios vietos savivaldyb nenurodoma.\r\n4. Jeigu per ketvirt vienoje savivaldybje, kurioje yra recept iraiusi gydymo staiga, receptus iraiusi gydytoj, turini t pai kvalifikacij, skaiius yra maesnis nei 3, gydytojo kvalifikacija nenurodoma.', 'https://data.gov.lt/datasets/2557/'),
(9, 4, 'Labai mao darbo intensyvumo nam kiuose gyvenantys asmenys', '2024-03-02', '2024-03-02', 'Statistin metin labai mao darbo intensyvumo Lietuvos privai nam ki informacija, kuriuose vis darbingo (1864 met) amiaus asmen (neskaitant 1824 met amiaus moksleivi ir student, pensininkams save priskyrusi arba bet koki pensij (iskyrus nali pensij) gaunani darbingo amiaus asmen bei 6064 met amiaus ekonomikai neaktyvi asmen, gyvenani nam kyje, kurio pagrindinis pajam altinis yra pensijos) dirbto laiko suma nevirija 20 proc. galimo dirbti viso darbo laiko.\r\nStatistins informacijos skelbimo periodikumas  metinis, nuo 2021 met. Naudojamas teritorini statistini vienet klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2546/'),
(10, 4, 'Ilaikomo amiaus pagyvenusi moni koeficientas met pradioje', '2024-03-02', '2024-03-02', 'Ilaikomo amiaus pagyvenusi (65 met ir vyresnio amiaus) nuolatini Lietuvos Respublikos gyventoj skaiiaus, tenkanio imtui 1564 met amiaus gyventoj, pasiskirstymas Lietuvos Respublikos teritorijos administraciniuose vienetuose.\r\nStatistins informacijos skelbimo periodikumas  metinis, nuo 1996 met. Naudojamas teritorini statistini vienet klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2545/'),
(11, 3, 'Neformaliojo vietimo programos', '2024-02-29', '2024-02-29', '2024 m. patvirtintos savivaldybs finansuojamos Neformaliojo vietimo programos', 'https://data.gov.lt/datasets/2553/'),
(12, 6, 'Visagino miesto WiFi4EU nemokamos belaidio interneto ryio zonos.', '2024-02-27', '2024-03-01', 'WiFi4EU rengtos nemokamos belaidio interneto ryio zonos Visagino mieste.', 'https://data.gov.lt/datasets/2551/'),
(13, 7, 'Dokument valdymo sistemos gaunami dokumentai', '2024-02-27', '2024-02-27', 'Dokument valdymo sistemos gaunami dokumentai', 'https://data.gov.lt/datasets/2390/'),
(14, 4, '18 met ir vyresni asmen skurdo rizikos lygis', '2024-02-14', '2024-03-02', 'Rinkinyje pateikiami duomenys apie 18 met ir vyresni asmen skurdo rizikos lyg pagal aktyvumo status grupes ir isilavinim. Skurdo rodikli skaiiavimo tikslas  parengti nacionalinius absoliutaus skurdo rodiklius bei palyginamus su kitomis Europos Sjungos alimis skurdo rizikos ir socialins atskirties rodiklius, stebti j pokyius, nustatyti daniausiai  absoliut skurd, skurdo rizik ir socialin atskirt patenkanias gyventoj grupes. Skurdo rodikliams rengti naudojami pajam ir gyvenimo slyg statistinio tyrimo duomenys. Naudojam klasifikatori nra. Statistinio stebjimo vienetas: Privatus nam kis ir 16 met ir vyresnis asmuo  privataus nam kio narys. Statistin tiriamoji visuma:  visi Lietuvos privats nam kiai ir nuolatiniai Lietuvos gyventojai. Asmenys, gyvenantys instituciniuose nam kiuose (globos namuose, eimynose, kalinimo staigose, vienuolynuose), nra tiriami. Geografin aprptis: Statistin informacija rengiama alies ir region lygmeniu, rodiklis Asmen, gyvenani skurdo rizikoje ar socialinje atskirtyje, dalis  ir apskrii lygmeniu. Laiko aprptis: Absoliutaus skurdo rodikliai  nuo 2016 m., asmen, gyvenani skurdo rizikoje ar socialinje atskirtyje, dalis taikant dabartin apibrt, didelio materialinio ir socialinio nepritekliaus lygis, isilavinimo lygis  nuo 2021 m., kiti rodikliai  nuo 2005 m. Periodikumas  metinis.', 'https://data.gov.lt/datasets/2550/'),
(15, 4, 'Skurdo rizikos lygis', '2024-02-14', '2024-03-02', 'Metin vis Lietuvos privai nam ki ir nuolatini Lietuvos gyventoj statistin informacija apie asmen, kuri ekvivalentins pinigins disponuojamosios pajamos maesns u skurdo rizikos rib, dal, j pasiskirstym pagal ami ir pilietyb, pajam kvintilines grupes, ami ir gimimo al nuo 2021 m.  Pagrindiniu skurdo kriterijumi laikoma skurdo rizikos riba, lygi 60 proc. ekvivalentini pinigini disponuojamj pajam medianos. Naudojami LR Administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018) ir Bendras teritorini statistini vienet klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2549/'),
(16, 4, 'Asmenys, gyvenantys skurdo rizikoje ar socialinje atskirtyje', '2024-02-14', '2024-03-02', 'Metinis nuolatini Lietuvos gyventoj, gyvenani skurdo rizikoje ar socialinje atskirtyje dalis per amiaus ir lyties, pajam kvintilines grupi, amiaus ir pilietybs, amiaus ir gimimo alies, isilavinimo, aktyvumo statuso dimensijas nuo 2021 met.', 'https://data.gov.lt/datasets/2548/'),
(17, 4, 'Materialinis ir socialinis nepriteklius', '2024-02-14', '2024-03-02', 'iame rinkinyje pateikta statistin informacija apie nam ki gyvenimo slygas. Rengiama statistin informacija apie nam kio bsto slygas, bsto ilaikymo ilaidas ir j nat, nam kio fizin ir socialin aplink, turimus siskolinimus, ekonominius sunkumus, su kuriais susiduria nam kis ar asmuo, ir galimyb tenkinti kai kuriuos poreikius. Statistinio stebjimo vienetas: privatus nam kis ir 16 met ar vyresnis asmuo  privataus nam kio narys. Laiko aprptis - nuo 2021 m., metinis.', 'https://data.gov.lt/datasets/2547/'),
(18, 8, 'Valstybins teritorij planavimo ir statybos inspekcijos rizikos valdymo informacins sistemos duomenys', '2024-02-12', '2024-02-12', '', 'https://data.gov.lt/datasets/2544/'),
(19, 9, 'Faktin nacionalin kit energijos altini gamyba (MW)', '2024-02-05', '2024-02-05', 'Faktin nacionalin kit energijos altini gamyba (skaitant gamyb skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2539/'),
(20, 9, 'Faktin prie PT prijungt ilumini elektrini gamyba (MW)', '2024-02-05', '2024-02-05', 'Faktin prie perdavimo tinklo prijungt ilumini elektrini gamyba. Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2540/'),
(21, 9, 'Prognozuojamas nacionalinis elektros energijos suvartojimas (MW)', '2024-02-05', '2024-02-05', 'Litgrid prognozuojamas nacionalinis sistemos elektros energijos suvartojimas. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2541/'),
(22, 9, 'Planuojamas nacionalinis elektros energijos suvartojimas (MW)', '2024-02-05', '2024-04-12', 'Balansavimo elektros energijos tiekj suplanuotas nacionalinis elektros energijos suvartojimas. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2542/'),
(23, 9, 'Faktinis nacionalinis Elektros energijos vartojimas (MW)', '2024-02-05', '2024-02-05', 'Rodiklis iskaiiuojamas pagal i logik:\r\nNacionalin gamyba + importas - eksportas - KHAE poreikis. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2543/'),
(24, 9, 'Faktin nacionalin kaupimo rengini gamyba', '2024-02-05', '2024-02-05', 'Faktin nacionalin kaupimo rengini gamyba. Skelbiami valandiniai akumuliuoti duomenys. Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2538/'),
(25, 6, 'Visagino savivaldybs tarnybiniai lengvieji automobiliai', '2024-02-01', '2024-02-01', '', 'https://data.gov.lt/datasets/2537/'),
(26, 10, 'Duomenys apie Lietuvos muziejus ir j padalinius', '2024-01-31', '2024-01-31', 'Duomenys apie Lietuvos Respublikos juridinius asmenis, kuri bent viena i ekonomini veiklos ri yra muziejini vertybi kaupimas, saugojimas ar tvarkymas. Tai apima:\r\n- Lietuvos muziejus;\r\n- staigas, kurios savo struktros apimtyje turi padalin, kuriam numatyta muziejin funkcija;\r\n- staigas, kaupianias, sauganias ir tvarkanias vertybi kolekcijas LIMIS (t. y. yra sudariusias LIMIS naudojimo sutartis).', 'https://data.gov.lt/datasets/2119/'),
(27, 11, 'Parama smulkiajam ir vidutiniam verslui', '2024-01-31', '2024-01-31', '', 'https://data.gov.lt/datasets/2536/'),
(28, 11, 'Vieieji pirkimai', '2024-01-31', '2024-01-31', '', 'https://data.gov.lt/datasets/2535/'),
(29, 12, 'Gydytoj skaiius pagal pareigybes (2023 m. duomenys)', '2024-01-15', '2024-01-15', 'Dokumente pateikiama informacija apie V Alytaus apskrities S. Kudirkos ligoninje dirbanius gydytojus pagal pareigybes (2023 m. duomenys).', 'https://data.gov.lt/datasets/2534/'),
(30, 4, 'Valdios sektoriaus skola (Mastrichto skola)', '2024-01-08', '2024-01-08', 'Valdios sektoriaus skola yra vienas i Mastrichto sutarties konvergencijos kriterij, skirt ekonomins padties valstybse narse stebsenai. Valdios sektoriaus skola apibriama kaip alies valdios sektoriaus (S.13) bendra negrinta skola nominalija verte ataskaitinio laikotarpio pabaigoje, iskyrus tuos sipareigojimus, kuriuos atitinkantis finansinis turtas priklauso alies valdios sektoriui (S.13). Valdios sektoriaus skol sudaro i kategorij sipareigojimai: valiuta ir indliai (AF.2); skolos vertybiniai popieriai (AF.3) ir paskolos (AF.4), kaip nustatyta ESS 2010. Ketvirtin valdios sektoriaus skola pateikiama pagal subsektorius: centrins valdios (S.1311), vietos valdios (S.1313) ir socialins apsaugos fondai (S.1314). \r\nNaudojami klasifikatoriai: Europos sskait sistema (ESS 2010). Statistinio stebjimo vienetas: instituciniai vienetai, priskiriami valdios sektoriui pagal ESS 2010. \r\nStatistin tiriamoji visuma: valdios sektorius (S.13). Geografin aprptis: visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 2000 m. I ketv.v. \r\nStatistins informacijos skelbimo periodikumas: ketvirtinis.', 'https://data.gov.lt/datasets/2495/'),
(31, 4, 'Medianinis gyventoj amius met pradioje', '2024-01-08', '2024-01-08', 'Pateikta statistin informacija apie medianin gyventoj ami met pradioje. Medianinis gyventoj amius  tokia gyventoj amiaus reikm, kuri atitinka variacins eiluts vidurin reikm, t. y. dalija gyventojus  dvi vienodas dalis taip, kad pus j yra jaunesni nei medianinio amiaus, kita pus  vyresni. Pasaulio ali ir teritorij klasifikatorius. Statistinio stebjimo vienetas - Asmuo. Statistin (tiriamoji) visuma yra prognozuojamas gyventoj, gyv gimusij, mirusij arba tarptautini migrant skaiius. Geografin aprptis: Visa alies teritorija, Europos Sjungos valstybs nars ir ELPA alys (Islandija, Norvegija, veicarija). \r\nLaiko aprptis: nuo 1970 m. \r\nStatistins informacijos skelbimo periodikumas: metiniai', 'https://data.gov.lt/datasets/2494/'),
(32, 4, 'Bendrasis gimstamumo rodiklis', '2024-01-08', '2024-01-08', 'Pateikiama statistin informacija apie bendrj gimstamumo rodikl. Bendrasis gimstamumo rodiklis  per metus gyv gimusi kdiki ir vidutinio metinio gyventoj skaiiaus santykis, skaiiuojamas 1 tkst. gyventoj. \r\nStatistinio stebjimo vienetas: gyvas gims kdikis. \r\nStatistin tiriamoji visuma: statistinis tyrimas apima: a) Lietuvos Respublikoje gyvus gimusius kdikius, kuri motinos yra nuolatins Lietuvos Respublikos gyventojos arba nra nustatytos, b) usienio valstybse gyvus gimusius kdikius, kuri motinos yra nuolatins Lietuvos Respublikos gyventojos. \r\nGeografin aprptis: statistin informacija rengiama alies, region, apskrii ir savivaldybi lygmeniu, pagal gyvenamj vietov (miest, kaim).\r\nLaiko aprptis: nuo 1994 m. \r\nStatistins informacijos skelbimo periodikumas: metinis.', 'https://data.gov.lt/datasets/2493/'),
(33, 4, 'Suminis gimstamumo rodiklis', '2024-01-08', '2024-01-08', 'Pateikta statistin informacija apie sumin gimstamumo rodikl. Suminis gimstamumo rodiklis  tikimybinis rodiklis, parodantis, kiek gyv vaik per vis savo gyvenimo vaising laikotarp (1549 met) pagimdyt moteris, jeigu gimstamumas kiekvienoje amiaus grupje ilikt nepakits. \r\nStatistin (tiriamoji) visuma yra prognozuojamas gyventoj, gyv gimusij, mirusij arba tarptautini migrant skaiius. Statistinio stebjimo vienetas: asmuo. \r\nStatistin tiriamoji visuma: statistin (tiriamoji) visuma yra prognozuojamas gyventoj, gyv gimusij, mirusij arba tarptautini migrant skaiius. \r\nGeografin aprptis: visa alies teritorija, Europos Sjungos valstybs nars ir ELPA alys (Islandija, Norvegija, veicarija). Laiko aprptis: nuo 2001m. \r\nStatistins informacijos skelbimo periodikumas: kasmet.', 'https://data.gov.lt/datasets/2492/'),
(34, 4, 'Valdios sektoriaus pajamos ir ilaidos', '2024-01-08', '2024-01-08', '\"Pateikta statistin informacija apie valdios sektoriaus pajamas ir ilaidas. Valdios sektoriaus pajamos vertinamos pagal sandorius: mokesiai D.2+D.5+D.91, socialins mokos D.61, preki ir paslaug pardavimas P.1+P.12+P.131, kitos einamosios pajamos D.4+D.7, kitos kapitalo pajamos D.92+D.99. Valdios sektoriaus ilaidos vertinamos pagal sandorius: tarpinis vartojimas P.2, atlygis darbuotojams D.1, palkanos D.41, socialins imokos, iskyrus socialinius pervedimus natra D.62, socialiniai pervedimai natra per rinkos gamintojus D.632, subsidijos D.3, kitos einamosios ilaidos D.29 + (D.4  D.41) + D.5 + D.7, kapitalo ilaidos P.5 + NP + D.92 + D.99. Naudojami klasifikatoriai: Europos sskait sistema (ESA 2010). Statistinio stebjimo vienetas -	instituciniai vienetai, priskiriami valdios sektoriui pagal ESA 2010. \r\nStatistin tiriamoji visuma: valstybs ir savivaldybi biudetins staigos, socialins apsaugos fondai, valdios sektoriaus kontroliuojamos mons, priskirtos valdios sektoriui. \r\nGeografin aprptis: visa alies teritorija. Laiko aprptis: 1999 m. \r\nStatistins informacijos skelbimo periodikumas: ketvirtis', 'https://data.gov.lt/datasets/2491/'),
(35, 9, 'Faktin nacionalin hidroelektrini gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktin nacionalin hidroelektrini gamyba (skaitant hidroakumuliacines ir gamyb skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys. Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2533/'),
(36, 9, 'Faktin nacionalin sauls elektrini gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktin nacionalin sauls elektrini gamyba (skaitant gamyb skirstomajame tinkle). Skelbiami valandiniai akumuliuoti duomenys (skelbiama prajusi valanda, atnaujinama dienos eigoje kas valand), susidedantys i kas 2 minutes skelbiam duomen.\r\nAtverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2532/'),
(37, 9, 'Faktin nacionalin vjo elektrini gamyba (MW)', '2023-12-29', '2024-02-05', 'Faktin nacionalin vjo elektrini gamyba (skaitant gamyb skirstomajame tinkle). Atverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2529/'),
(38, 9, 'Faktin nacionalin elektros energijos gamyba (MW)', '2023-12-29', '2024-03-25', 'Faktin nacionalin elektros energijos gamyba. Gali bti nurodoma informacija dvi minutini laikotarpiu. \r\nKomisijos reglamentas (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried.\r\nDaugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2530/'),
(39, 9, 'Nacionalin elektros energijos gamyba', '2023-12-29', '2023-12-29', 'Atverta prieiga prie elektros nacionalins elektros energijos gamybos duomen. Duomenis sudaro: planuojama ir faktin nacionalin energijos gamyba; faktin nacionalin vjo elektrini, sauls elektrini, hidroelektrini, ilumini elektrini ir kit energijos altini gamyba; faktin nacionalin kaupimo rengini gamyba. Daugiau informacijos apie duomenis adresu: litgrid.eu', 'https://data.gov.lt/datasets/2528/'),
(40, 4, 'Viebui ir moteli numeri ir viet uimtumas', '2023-12-29', '2024-01-10', 'Pateikta statistin informacija apie mnesin, ketvirtin, metin apgyvendinimo paslaug tiekj uimt viet arba numeri skaii pagal administracin teritorij ir apgyvendinimo tipus. Naudojami klasifikatoriai: Lietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018); \r\n\r\nApibrtys: Apgyvendinimo staiga  vietos veiklos ries vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Turistas  fizinis asmuo, keliaujantis  vietov, esani u jo prastins aplinkos rib, apsistojantis joje bent vienai nakvynei, bet ne ilgiau kaip 12 mn., ir neturintis tikslo joje mokytis ar dirbti apmokamo darbo. Nakvyn  kiekviena naktis, kuri turistas faktikai praleidia (miega ar bna) ar bna registruotas (jo fizinis buvimas nebtinas) apgyvendinimo staigoje. Numeris (kambarys)  apgyvendinimui skirtame pastate specialiai rengta patalpa ar patalp grup, apgyvendinimo paslaug teikjo siloma asmenims nuomotis kaip nedaloma visuma. Numeri (kambari) uimtumas  uimt numeri (kambari) ir apgyvendinimui paruot numeri (kambari) skaiiaus santykis, ireiktas procentais. Viet skaiius  lov skaiius, kuris nustatomas numeriuose (kambariuose) ar atskirose patalpose pagal asmen skaii, kuriems gali bti suteikta nakvyn (dvigul lova yra dvi vietos). Viet uimtumas  nakvyni skaiiaus ir apgyvendinimui paruot viet skaiiaus santykis, ireiktas procentais. Statistinio stebjimo vienetas - Apgyvendinimo staiga (vietos veiklos ries vienetas). Tiriamj visum (populiacij) sudaro: juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.2  poilsiautoj ir kita trumpalaikio apgyvendinimo veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3). fiziniai asmenys, dirbantys pagal verslo liudijim (010, 043 kodai pagal Verslo liudijim klasifikatori) ar (ir) individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografin aprptis - statistin informacija rengiama alies, region, apskrii ir savivaldybi lygmeniu.\r\nLaiko aprptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2442/'),
(41, 4, 'Ivykusi vienadieni lankytoj skaiius (pagal valstyb ketvirtiniai)', '2023-12-29', '2023-12-29', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii. \r\nPateikta per tikslo valstybs dimensij. \r\nNaudojami klasifikatoriai: Pasaulio ali ir teritorij klasifikatorius. \r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio. \r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. \r\nNeskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas. \r\nGeografin aprptis: visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 2005m.\r\nPeriodikumas: ketvirtinis.', 'https://data.gov.lt/datasets/2476/'),
(42, 4, 'Didmenins prekybos moni apyvartos (be PVM) indeksai palyginamosiomis kainomis (2015 m.  100)', '2023-12-27', '2024-01-02', 'Rinkinyje pateikiami duomenys apie  trumpalaikius didmenins prekybos moni, iskyrus prekyb variklinmis transporto priemonmis ir motociklais, apyvartos (be PVM) pokyius. Pateikta per Ekonomins veiklos ries (EVRK 2 red.), ilyginimo ir lyginimo dimensijas. Naudojamas ekonomins veiklos ri klasifikatorius (EVRK 2 red.).\r\nStatistinio stebjimo vienetas: mon. \r\nStatistin tiriamoji visuma: vis ri ir dydi veikianios mons, kuri pagrindin ekonomin veikla vardyta EVRK 2 red. G sekcijos 46 skyriuje. \r\nGeografin aprptis: visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 2010 m. sausio mn. \r\nPeriodikumas  mnesinis.', 'https://data.gov.lt/datasets/2473/'),
(43, 4, 'Mamenins prekybos, variklini transporto priemoni, maitinimo moni apyvartos (be PVM) indeksai palyginamosiomis kainomis (2015 m.  100)', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie trumpalaikius mamenins prekybos, variklini transporto priemoni, maitinimo moni apyvartos (be PVM) pokyius. \r\nPateikta per Ekonomins veiklos ries (EVRK 2 red.), ilyginimo ir lyginimo dimensijas. Naudojamas ekonomins veiklos ri klasifikatorius (EVRK 2 red.). \r\nStatistinio stebjimo vienetas: mon. \r\nStatistin tiriamoji visuma: vis ri ir dydi veikianios mons, kuri pagrindin ekonomin veikla vardyta EVRK 2 red. G sekcijos 45, 46, 47 skyriuose ir I sekcijos 56 skyriuje. \r\nGeografin aprptis: visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1998 m. sausio mn. \r\nPeriodikumas  mnesinis.', 'https://data.gov.lt/datasets/2471/'),
(44, 4, 'Energijos sraut itekliai', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie gamtini energijos itekli, energetikos produkt, energetini liekan fizinius energijos sraut iteklius. \r\nNaudojami klasifikatoriai: ekonomins veiklos ri klasifikatorius (EVRK 2 red.). \r\nStatistinio stebjimo vienetas: kio subjektas, skaitant nam k. \r\nStatistin tiriamoji visuma: alies vienetai rezidentai ir ne rezidentai, kurie gali bti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografin aprptis: statistiniai rodikliai yra skaiiuojami ekonomins teritorijos mastu, vertinant alies vienet rezident kuro ir energijos sunaudojim usienyje ir vienet ne rezident kuro ir energijos sunaudojim Lietuvos teritorijoje.\r\nLaiko aprptis: nuo 2014 m. \r\nPeriodikumas  metinis.', 'https://data.gov.lt/datasets/2466/'),
(45, 4, 'Statybos snaud element kain indeksai (2015 m.  100)', '2023-12-27', '2024-01-02', 'Rinkinyje pateikiami duomenys vairi laikotarpi statybos snaud element kain indeks (SSKI). SSKI skaiiavimo tikslas  nustatyti naujos statybos pagrindini statybos snaud element bendrj kain pokyt per mnesio laikotarp. SSKI reikalingas vairiems rodikliams palyginamosiomis kainomis skaiiuoti, ekonomikos raidai analizuoti, statybos infliaciniams procesams vertinti. Skaiiuojami bendrasis SSKI bei atskir statybos snaud element kain indeksai ir kain pokyiai. Pateikta per statini pagal tip klasifikatoriaus (CC) dimensij. \r\nNaudojami klasifikatoriai: statini pagal tip klasifikatorius (CC).\r\nStatistinio stebjimo vienetas: statistinis vienetas pagal veiklos r. \r\nStatistin tiriamoji visuma: statistiniame tyrime aprpiamos vis nuosavybs form veikianios statybos mons, kuri naujos statybos darb apimtis bendroje savo jgomis atlikt statybos darb apimtyje vertine iraika yra ne maesn nei 50 proc. (EVRK 2 red. Sekcija F) ir prekybos mons, reprezentuojanios esam prekybos statybinmis mediagomis ir gaminiais moni tinkl (EVRK 2 red. Sekcija G).\r\nGeografin aprptis: Visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1998 m. sausio mn. \r\nPeriodikumas  mnesinis.', 'https://data.gov.lt/datasets/2470/'),
(46, 4, 'Energijos sraut panaudojimas', '2023-12-27', '2024-01-03', 'Rinkinyje pateikiami duomenys apie gamtini energijos itekli, energetikos produkt, energetini liekan fizin energijos sraut panaudojim. \r\nNaudojami klasifikatoriai: ekonomins veiklos ri klasifikatorius (EVRK 2 red.). \r\nStatistinio stebjimo vienetas: kio subjektas, skaitant nam k. \r\nStatistin tiriamoji visuma: alies vienetai rezidentai ir ne rezidentai, kurie gali bti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografin aprptis: statistiniai rodikliai yra skaiiuojami ekonomins teritorijos mastu, vertinant alies vienet rezident kuro ir energijos sunaudojim usienyje ir vienet ne rezident kuro ir energijos sunaudojim Lietuvos teritorijoje. \r\nLaiko aprptis: nuo 2014 m. \r\nPeriodikumas  metinis.', 'https://data.gov.lt/datasets/2467/'),
(47, 4, 'Energijos srautai', '2023-12-27', '2023-12-27', 'Rinkinyje pateikiami duomenys apie gamtini energijos itekli, energetikos produkt, energetini liekan gavyb, gamyb, suvartojim ir sunaudojim. \r\nNaudojami klasifikatoriai: ekonomins veiklos ri klasifikatorius (EVRK 2 red.). \r\nStatistinio stebjimo vienetas: kio subjektas, skaitant nam k. \r\nStatistin tiriamoji visuma: alies vienetai rezidentai ir ne rezidentai, kurie gali bti ir juridiniai vienetai, ir fiziniai asmenys. \r\nGeografin aprptis: statistiniai rodikliai yra skaiiuojami ekonomins teritorijos mastu, vertinant alies vienet rezident kuro ir energijos sunaudojim usienyje ir vienet ne rezident kuro ir energijos sunaudojim Lietuvos teritorijoje. \r\nLaiko aprptis: nuo 2014 m. \r\nPeriodikumas  metinis.', 'https://data.gov.lt/datasets/2444/'),
(48, 4, 'Nakvyni skaiius apgyvendinimo staigose', '2023-12-22', '2024-01-09', 'Duomen rinkinys apie apgyvendinimo paslaug tiekj skaii pagal apgyvendinimo tipus, numeri ir viet skaii, j uimtum, apgyvendint turist ir j nakvyni skaii pagal atvykusi turist gyvenamj al. \r\nNaudojami klasifikatoriai:\r\n- Ekonomins veiklos ri klasifikatorius (EVRK 2 red.); \r\n- Pasaulio ali ir teritorij klasifikatorius; \r\n- Lietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018); \r\n- Verslo liudijim klasifikatorius; \r\n- Teritorini statistini vienet klasifikatorius (NUTS). \r\nStatistinio stebjimo vienetas: apgyvendinimo staiga (vietos veiklos ries vienetas). \r\nStatistin tiriamoji visuma: juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.2  poilsiautoj ir kita trumpalaikio apgyvendinimo veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijim (010, 043 kodai pagal Verslo liudijim klasifikatori) ar (ir) individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografin aprptis: visa alies ekonomin teritorija.\r\nLaiko aprptis: nuo 2012m.\r\nPeriodikumas: ketvirtinis.', 'https://data.gov.lt/datasets/2479/'),
(49, 4, 'Ivykusi vienadieni lankytoj ilaidos', '2023-12-22', '2023-12-22', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei kelioni ilaidas. \r\nPateikta per tikslo valstybs dimensij. \r\nNaudojami klasifikatoriai: Pasaulio ali ir teritorij klasifikatorius. \r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio. Statistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas. Geografin aprptis: visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 2005m.\r\nPeriodikumas: ketvirtinis.', 'https://data.gov.lt/datasets/2477/'),
(50, 4, 'Ivykusi Lietuvos gyventoj ir atvykusi usieniei kelioni skaiius', '2023-12-22', '2023-12-22', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei kelioni ilaidas.\r\nNaudojami klasifikatoriai: Pasaulio ali ir teritorij klasifikatorius. \r\nStatistinio stebjimo vienetas: Atvykstanio usienieio ar ivykstanio Lietuvos Respublikos nuolatinio gyventojo kelion, kurios metu asmuo kerta Lietuvos Respublikos pasienio kontrols punkt ar Lietuvos Respublikos teritorijos ribas sausumoje, oro erdvje, vandenyse. \r\nStatistin tiriamoji visuma: Tiriamj visum sudaro vis asmen, kertani Lietuvos Respublikos teritorijos ribas, kelions. Stebimi visi asmenys, kertantys Lietuvos Respublikos teritorijos ribas, neatsivelgiant  j ami. Neskaitomos pasienyje dirbani darbuotoj kelions. \r\nGeografin aprptis: Visos Lietuvos Respublikos pasienio ribos. \r\nLaiko aprptis: nuo 2007 m.\r\nPeriodikumas: metinis.', 'https://data.gov.lt/datasets/2478/'),
(51, 4, 'Bsto kain indeksai', '2023-12-22', '2023-12-22', 'Rinkinyje pateikiami duomenys apie bsto kain indeks. Bsto kain indeksas (BKI)  santykinis rodiklis, kuriuo ireikiamas nam ki sigyjam bst, skaitant em, bendrasis kain pokytis per tam tikr laikotarp. Bsto kain indekso (toliau  BKI) sudarymo tikslas  turti su kitomis Europos Sjungos (ES) valstybmis narmis metodologikai suderint rodikl bsto kain pokyiams imatuoti. BKI reikalingas formuojant pinig politik, rengiant infliacijos prognozes ir konvergencijos ataskaitas, vertinant finansin stabilum, atliekant tarptautinius palyginimus. Sudarant BKI nam ki ilaidos bstui sigyti klasifikuojamos  tokias ilaid kategorijas: H.1. Bst sigijimas; H.1.1. Naujo bsto sigijimas; H.1.2. Esam bst sigijimas. Statistinio stebjimo vienetas - nam kio bstas ir kartu su juo sigyjama em. Tiriamoji visuma - alies rezident ir ne rezident nam ki alies teritorijoje sigyjami bstai. Nam ki sektorius apima visus asmenis ar asmen grupes, neatsivelgiant  tai, kur jie gyvena, koki viet uima pajam pasiskirstyme, j tautyb bei pilietyb. Duomenys renkami i visos alies ekonomins teritorijos nuo 2006m. I ketvirio ir atnaujinami kas ketvirt. BKI bazinis laikotarpis yra 2015 m. (2015 m.  100). Kitas BKI bazinio laikotarpio keitimas numatytas 2026 m., buvusi laiko eilut bus perskaiiuota  nauj indekso bazin laikotarp ir paskelbta apskaiiavus 2026 m. I ketv. BKI. Pagrindinis statistini duomen altinis BKI apskaiiuoti yra V Registr centro Nekilnojamojo turto registro ir Sandori duomen bazi duomenys.', 'https://data.gov.lt/datasets/2526/'),
(52, 4, 'Ivykusi vienadieni lankytoj kelioni skaiius', '2023-12-22', '2023-12-29', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei kelioni ilaidas. \r\nNaudojami klasifikatoriai: Pasaulio ali ir teritorij klasifikatorius. Statistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio. \r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas. Geografin aprptis: visa alies ekonomin teritorija.\r\nLaiko aprptis: nuo 2005 m.\r\nPeriodikumas: metinis ir ketvirtinis.', 'https://data.gov.lt/datasets/2445/'),
(53, 4, 'Imetamj teral jungiamieji rodikliai', '2023-12-20', '2023-12-20', ' or imetam teral sskaitose nurodomi duomenys apie alies vienet rezident, kaip jie yra apibrti Europos nacionalini ir regionini sskait sistemoje (ESS), imetam likutini dujini ir kietj daleli mediag srautus.\r\n or imetami teralai  i nacionalinio kio (gamybos ar vartojimo proces)  atmosfer (kuri yra aplinkos dalis) patenkantis fizinis dujini ar kietj daleli mediag srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dl Europos aplinkos ekonomini sskait, rengiami statistiniai duomenys apie iuos  or imetamus teralus: anglies dioksid (CO2), iskyrus isiskiriant i biomass; anglies dioksid i biomass (biomass CO2); azoto oksid (N2O); metan (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluorid (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksid (CO); kietsias daleles < 10 mikron (PM10); kietsias daleles < 2,5 mikron (PM2,5); sieros dioksid (SO2); amoniak (NH3).\r\n\r\nGeografin aprptis: Visa alies teritorija\r\n\r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2440/'),
(54, 4, 'Numeri, kuriais gali naudotis riboto judumo asmenys, skaiius', '2023-12-20', '2024-01-08', 'Pateikta statistin informacija apie numeri, kuriais gali naudotis riboto judumo asmenys, skaii apgyvendinimo staigose pagal apgyvendinimo staigos tipus, laikotarp. Statistinio stebjimo vienetas - apgyvendinimo staiga (vietos veiklos ries vienetas). Naudojamas Ekonomins veiklos ri klasifikatorius (EVRK 2 red.). Tiriamj visum (populiacij) sudaro: 1) juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal EVRK 2 red. I sekcijos grup 55.1  viebui ir panai laikin buveini veikla; 2) fiziniai asmenys, dirbantys pagal individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grup 55.1) paslaugas turistams. Statistin informacija rengiama alies lygmeniu. Laiko aprptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2454/'),
(55, 4, 'Apgyvendinimo staig skaiius', '2023-12-19', '2023-12-29', 'Ketvirtiniai, metiniai apgyvendinimo paslaug tiekj kiekiai pagal administracin teritorij, apgyvendinimo tip ir viebuio kategorij. \r\nNaudojami klasifikatoriai: Lietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018);\r\nApibrtys: Apgyvendinimo staiga  vietos veiklos ries vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Statistin tiriamoji visuma juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.2  poilsiautoj ir kita trumpalaikio apgyvendinimo veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijim (010, 043 kodai pagal Verslo liudijim klasifikatori) ar (ir) individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3) paslaugas turistams. \r\nGeografin aprptis: statistin informacija rengiama alies, region, apskrii ir savivaldybi lygmeniu.\r\nLaiko aprptis: nuo 2012 m.', 'https://data.gov.lt/datasets/2443/'),
(56, 4, 'BVP, palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-18', '2024-01-05', 'Statistins informacijos apraymas: bendrasis vidaus produktas (BVP)  vienas i pagrindini nacionalini sskait sistemos (NSS) rodikli, apibdinani alies ekonomikos isivystymo lyg. BVP, jo kitimo tempas ir bendrosios nacionalins pajamos (BNP) plaiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebjimo vienetas: nacionalins sskaitos apimanios ekonomik, kaip visum, kuri sudaro skirtingi instituciniai vienetai. Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Lietuvos nacionalins sskaitos yra isamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomen altini (tyrim, administracini duomen) pagrindu arba per isamumo korekcijas.\r\nGeografin aprptis: alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1995 m. \r\nMatavimo vienetas (-ai): palyginamosios kainos  mln. EUR \r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2469/'),
(57, 4, 'Uimtumas (ESS 2010)', '2023-12-18', '2024-01-05', 'Pateikiama statistin informacija -uimtumas pagal ekonomins veiklos r, apskritis, uimtj klasifikacij (metinis). Uimtumo svokai priskiriami visi asmenys, vykdantys nacionalini sskait gamybos sriiai priskiriam gamybin veikl. Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version), teritorini statistini vienet klasifikatorius (NUTS). Statistin (tiriamj) visum sudaro visi alies ekonominje teritorijoje dirbantys asmenys  samdomieji darbuotojai arba savarankikai dirbantys asmenys (rezidentai ir ne rezidentai), skaitant auktinius ir atskaitant alies gyventojus  samdomuosius darbuotojus, dirbanius laikin darb kitose alyse. \r\nGeografin aprptis - alies ekonomin teritorija. \r\nLaiko aprptis - nuo 2000 m.', 'https://data.gov.lt/datasets/2468/'),
(58, 4, 'BVP ilaid metodu, palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-18', '2024-01-05', 'Statistins informacijos apraymas: bendrasis vidaus produktas (BVP)  vienas i pagrindini nacionalini sskait sistemos (NSS) rodikli, apibdinani alies ekonomikos isivystymo lyg. BVP, jo kitimo tempas ir bendrosios nacionalins pajamos (BNP) plaiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebjimo vienetas: nacionalins sskaitos apimanios ekonomik kaip visum, kuri sudaro skirtingi instituciniai vienetai. Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Lietuvos nacionalins sskaitos yra isamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomen altini (tyrim, administracini duomen) pagrindu arba per isamumo korekcijas.\r\nGeografin aprptis: alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1995 m. \r\nMatavimo vienetas (-ai): palyginamosios kainos  mln. EUR.\r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2465/'),
(59, 4, 'Metinis: Uimtumo lygis (pagal tikslines amiaus grupes ir lyt)', '2023-12-18', '2024-01-03', 'Pateikta statistin informacija apie gyventoj uimtum pagal amiaus grupes, lyt ir gyvenam vietov. Informacija pateikiama kas ketvirt nuo 1998 met. Tiriamoji visuma  visi nuolatiniai Lietuvos gyventojai. Statistinio stebjimo vienetas - privatus nam kis bei jo narys. \r\nTyrimo apibrtis - uimti gyventojai, asmenys, dirbantys bet kok darb, gaunantys u j atlyg pinigais ar natra arba turintys i jo pajam ar pelno. Tyrime uimtais gyventojais laikomi 1589 met gyventojai, tiriamj savait ne trumpiau kaip valand dirb bet kok darb, u kur gavo darbo umokest pinigais ar atlyg natra ar i kurio turjo pelno ar pajam, taip pat gyventojai, kurie turjo darb, bet tiriamj savait laikinai nedirbo.', 'https://data.gov.lt/datasets/2520/'),
(60, 4, 'Ekvivalentini disponuojamj pajam Gini koeficientas', '2023-12-18', '2023-12-20', 'Pateikta statistin informacija apie nam ki disponuojam pajam Gini koeficientus.\r\nTyrimo apibrtis tai disponuojamosios nam kio pajamos  bendrosios nam kio pajamos atskaiius pajam mokest, nuolatinius turto mokesius, darbuotoj, savarankikai dirbani asmen ir bedarbi (jei taikoma) privalomojo socialinio draudimo mokas ir reguliarius pervedimus kitiems nam kiams. Statistinio stebjimo vienetas - privatus nam kis. Laiko aprptis  nuo 2008 m., metinis.', 'https://data.gov.lt/datasets/2519/'),
(61, 4, 'Sveikatos prieiros finansavimo program ilaidos funkcijoms', '2023-12-18', '2023-12-20', 'Pateikta statistin informacija apie sveikatos prieiros ilaidas program funkcijoms. Tyrimo statistinio stebjimo vienetas institucinis vienetas, renkantis las sveikatos prieiros finansavimo programoms. Informacija kaupiama nuo 2007 met (metinis) ir apima visus alies ekonomins teritorijos sveikatos prieiros paslaug ir preki teikjus. Tyrimo apibrtis - asmen ir visuomens grupi sveikatos prieiros poreikiams patenkinti skirtos sveikatos prieiros paslaug ir (arba) preki grups (gydymas, reabilitacija, slauga ir pan.). \r\nTyrime naudojama sveikatos prieiros funkcij klasifikacija (ICHA-HC).', 'https://data.gov.lt/datasets/2518/'),
(62, 4, 'Sveikatos prieiros finansavimo program ilaidos teikjams', '2023-12-18', '2024-01-08', 'Pateikta statistin informacija apie sveikatos prieiros ilaidas program teikjams. Tyrimo statistinio stebjimo vienetas institucinis vienetas, renkantis las sveikatos prieiros finansavimo programoms. Informacija kaupiama nuo 2007 met (metinis) ir apima visus alies ekonomins teritorijos sveikatos prieiros paslaug ir preki teikjus. Tyrimo apibrtis - l, skirt sveikatos prieiros prekms ir paslaugoms finansuoti, padidjimas taikant specifinius finansavimo mechanizmus. Tyrime naudojama sveikatos prieiros finansavimo program pajam (ICHA-FS) ir sveikatos prieiros finansavimo program klasifikacijos (ICHA-HF).', 'https://data.gov.lt/datasets/2517/'),
(63, 4, 'Ilaidos sveikatos prieiros funkcijoms ir teikjams', '2023-12-18', '2023-12-20', 'Pateikta statistin informacija apie sveikatos prieiros ilaidas funkcijoms ir teikjams. Tyrimo statistinio stebjimo vienetas tai mon, teikianti galutinio vartojimo sveikatos prieiros prekes ir (arba) paslaugas. Informacija kaupiama nuo 2007 met (metinis) ir apima visus alies ekonomins teritorijos sveikatos prieiros paslaug ir preki teikjus. Geografin aprptis - visa ekonomin alies teritorija.\r\nTyrime naudojama sveikatos prieiros funkcij ICHA-HC ir sveikatos prieiros paslaug teikj klasifikacijos ICHA-HP.', 'https://data.gov.lt/datasets/2516/');
INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(64, 4, 'Kdiki mirtingumo rodiklis', '2023-12-18', '2023-12-22', 'Pateikta statistin informacija apie Lietuvos Respublikos negyv gimusi kdiki skaii pagal gyvenamj vietov, lyt, laikotarp ir ineiojimo ami. Tyrimas apima Lietuvos Respublikoje negyvus gimusius kdikius, kuri motinos yra nuolatins Lietuvos Respublikos gyventojos. Statistinio stebjimo vienetas - negyvas gims kdikis. Laiko aprptis  nuo 2000 m., metinis.\r\nTyrime naudojami klasifikatoriai:\r\nPasaulio ali ir teritorij klasifikatorius (https://osp.stat.gov.lt/lt/web/guest/pasaulio-saliu-ir-teritoriju-klasifikatorius)\r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018) (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=861&tab=version)\r\nTeritorini statistini vienet klasifikatorius (NUTS)(https://osp.stat.gov.lt/lt/web/guest/teritoriniu-statistiniu-vienetu-klasifikatorius-nuts)', 'https://data.gov.lt/datasets/2515/'),
(65, 4, 'Bendrasis mirtingumo rodiklis', '2023-12-18', '2023-12-22', 'Pateikta statistin informacija apie mirusi Lietuvos Respublikos nuolatini gyventoj skaii pagal gyvenamj vietov, administracin teritorij, lyt ir laikotarp. Tyrimas apima mirusius Lietuvos Respublikos nuolatinius gyventojus. Statistinio stebjimo vienetas  mirs asmuo. Laiko aprptis - nuo 1950 m., metinis.\r\nTyrime naudojami klasifikatoriai:\r\nPasaulio ali ir teritorij klasifikatorius (https://osp.stat.gov.lt/lt/web/guest/pasaulio-saliu-ir-teritoriju-klasifikatorius)\r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018) (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=861&tab=version)\r\nTeritorini statistini vienet klasifikatorius (NUTS)(https://osp.stat.gov.lt/lt/web/guest/teritoriniu-statistiniu-vienetu-klasifikatorius-nuts)', 'https://data.gov.lt/datasets/2514/'),
(66, 4, 'Ivykusi turist vidutins vienos kelions ilaidos', '2023-12-18', '2023-12-21', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei vidutines vienos kelions ilaidas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio ali ir teritorij klasifikatorius.\r\n\r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio..\r\n\r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2513/'),
(67, 4, 'Ivykusi turist vidutins dienos ilaidos', '2023-12-18', '2023-12-21', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei vidutines vienos dienos kelioni ilaidas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio ali ir teritorij klasifikatorius.\r\n\r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio..\r\n\r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2512/'),
(68, 4, 'Parduota gamini', '2023-12-18', '2023-12-27', 'Duomen rinkinys apie pramonini gamini gamyb ir pardavim natrine ir vertine iraika. Pateikta per apskrities, rinkos, dalies, gamini ries dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\n\r\nProdukt, gamini ir paslaug klasifikatoriaus (PGPK 2022 II dalis (PRODCOM)) versijos patvirtinimas (2022 m. sausio 26 d. Nr. D - 32);\r\n\r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018);\r\n\r\nStatistinio stebjimo vienetas: mon.\r\n\r\nStatistin tiriamoji visuma: visos veikianios mons, kuri pagrindin ekonomin veikla yra pramonin veikla (EVRK 2 red. B ir C sekcijos, E sekcijos 38 skyrius) ir nepramonins mons, vykdanios pramonin veikl.\r\n\r\nGeografin aprptis: Statistin informacija rengiama alies, Sostins regiono ir Vidurio ir vakar Lietuvos regiono, apskrii lygmeniu.\r\n\r\nLaiko aprptis: nuo 2005m., metinis.', 'https://data.gov.lt/datasets/2510/'),
(69, 4, 'Pagaminta gamini natriniais vienetais', '2023-12-18', '2023-12-22', 'Duomen rinkinys apie pramonini gamini gamyb ir pardavim natrine ir vertine iraika. Pateikta per apskrities, dalies, gamini ries dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\n\r\nProdukt, gamini ir paslaug klasifikatoriaus (PGPK 2022 II dalis (PRODCOM)) versijos patvirtinimas (2022 m. sausio 26 d. Nr. D - 32);\r\n\r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018);\r\n\r\nStatistinio stebjimo vienetas: mon.\r\n\r\nStatistin tiriamoji visuma: visos veikianios mons, kuri pagrindin ekonomin veikla yra pramonin veikla (EVRK 2 red. B ir C sekcijos, E sekcijos 38 skyrius) ir nepramonins mons, vykdanios pramonin veikl.\r\n\r\nGeografin aprptis: Statistin informacija rengiama alies, Sostins regiono ir Vidurio ir vakar Lietuvos regiono, apskrii lygmeniu.\r\n\r\nLaiko aprptis: nuo 2005m., metinis.', 'https://data.gov.lt/datasets/2509/'),
(70, 4, 'Atliek susidarymas ir tvarkymas', '2023-12-18', '2023-12-22', 'Duomen rinkinys apie kiek per ataskaitinius metus Lietuvoje susidar ir buvo surinkta atliek bei kiek ir kokiomis atliek tvarkymo veiklomis atliekos buvo sutvarkytos Lietuvoje ar ivetos (eksportuotos) tvarkyti  kitas valstybes. Pateikta per atliek ries ir atliek tvarkymo bd dimensijas. \r\n\r\nNaudojami klasifikatoriai: \r\nAtliek kod sraas  oficialiai skelbiamas Atliek tvarkymo taisykli, patvirtint Lietuvos Respublikos aplinkos ministro 1999-07-14 sakymu Nr. 217 Dl Atliek tvarkymo taisykli patvirtinimo (toliau  Atliek tvarkymo taisykls), 1 priede;\r\n\r\nAtliek statistinis klasifikatorius  oficialiai skelbiamas Europos Parlamento ir Tarybos Reglamento (EB) Nr. 2150/2002 dl atliek statistikos III priede;\r\n\r\nAtliek tvarkymo veikl sraas  oficialiai skelbiamas Atliek tvarkymo taisykli 2 priede.\r\n\r\nStatistinio stebjimo vienetas: kio subjektas, vykdantis atliek susidarymo ir (ar) tvarkymo apskait.\r\n\r\nStatistin tiriamoji visuma: Lietuvos Respublikos teritorijoje veikl vykdantys kio subjektai (atliek darytojai ir atliek tvarkytojai), kurie teiss akt nustatyta tvarka privalo vykdyti atliek susidarymo ir (ar) tvarkymo apskait.\r\n\r\nGeografin aprptis: visa alies teritorija\r\n\r\nLaiko aprptis: nuo 2016m., metinis.', 'https://data.gov.lt/datasets/2508/'),
(71, 4, 'Atliek susidarymas ir tvarkymas ems kyje, mikininkystje ir uvininkystje', '2023-12-18', '2023-12-27', 'Duomen rinkinys apie atliek susidarym ir tvarkym ems kyje, mikininkystje ir uvininkystje. Pateikta per atliek ries ir atliek tvarkymo bd dimensijas.\r\n\r\nNaudojami klasifikatoriai: Ekonomins veiklos ri klasifikatorius (EVRK 2 red.)\r\n\r\nStatistinio stebjimo vienetas: vis ri ems kio, mikininkysts ir uvininkysts mons, kinink ir eimos kiai\r\n\r\nStatistin tiriamoji visuma: tyrimo populiacij sudaro kinink ir eimos kiai, vis teisini form mons, vykdanios ems kio, mikininkysts ir uvininkysts ekonomin veikl, kuriose dirba 5 ir daugiau darbuotoj. Tyrimas apima mones, kuri pagrindin ekonomin veikla priskiriama EVRK 2 red. A sekcijos 0103 skyriams.\r\n\r\nGeografin aprptis: statistin informacija rengiama alies lygmeniu.\r\n\r\nLaiko aprptis: nuo 2006m., kas du metus.', 'https://data.gov.lt/datasets/2507/'),
(72, 4, 'moni pajamos i alutini produkt aplinkos tausojimui', '2023-12-18', '2023-12-21', 'Duomen rinkinys apie moni pajamas i alutini produkt aplinkos tausojimui. Pateikta per ekonomins veiklos ries, aplinkos apsaugos veiklos  dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: mon\r\n\r\nStatistin tiriamoji visuma: Tyrimo populiacij sudaro visos per ataskaitin laikotarp veikusios akcins ir udaros akcins bendrovs, valstybs ir savivaldybs mons, usienio moni filialai, ems kio ir kooperatins bendrovs, turinios 5 ir daugiau darbuotoj. Tyrimas apima kasybos ir karjer eksploatavimo, apdirbamosios gamybos, elektros, duj, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos ris pagal EVRK 2 red.\r\n\r\nGeografin aprptis: statistin informacija rengiama alies lygmeniu.\r\n\r\nLaiko aprptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2506/'),
(73, 4, 'moni einamosios ilaidos aplinkos tausojimui', '2023-12-18', '2023-12-20', 'Duomen rinkinys apie moni ilaidas aplinkos tausojimui. Pateikta per ekonomins veiklos ries, aplinkos apsaugos veiklos ir ilaid ries dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: mon\r\n\r\nStatistin tiriamoji visuma: Tyrimo populiacij sudaro visos per ataskaitin laikotarp veikusios akcins ir udaros akcins bendrovs, valstybs ir savivaldybs mons, usienio moni filialai, ems kio ir kooperatins bendrovs, turinios 5 ir daugiau darbuotoj. Tyrimas apima kasybos ir karjer eksploatavimo, apdirbamosios gamybos, elektros, duj, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos ris pagal EVRK 2 red.\r\n\r\nGeografin aprptis: statistin informacija rengiama alies lygmeniu.\r\n\r\nLaiko aprptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2505/'),
(74, 4, 'moni investicijos aplinkos tausojimui', '2023-12-18', '2023-12-22', 'Duomen rinkinys apie moni ilaidas aplinkos tausojimui. Pateikta per ekonomins veiklos ries, aplinkos apsaugos veiklos ir investicij krypties dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: mon\r\n\r\nStatistin tiriamoji visuma: Tyrimo populiacij sudaro visos per ataskaitin laikotarp veikusios akcins ir udaros akcins bendrovs, valstybs ir savivaldybs mons, usienio moni filialai, ems kio ir kooperatins bendrovs, turinios 5 ir daugiau darbuotoj. Tyrimas apima kasybos ir karjer eksploatavimo, apdirbamosios gamybos, elektros, duj, garo tiekimo ir oro kondicionavimo, vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo, statybos, transporto ir saugojimo veiklos ris pagal EVRK 2 red.\r\n\r\nGeografin aprptis: statistin informacija rengiama alies lygmeniu.\r\n\r\nLaiko aprptis: nuo 2008m., metinis.', 'https://data.gov.lt/datasets/2504/'),
(75, 4, 'Pervesta aplinkos apsaugai', '2023-12-18', '2023-12-20', 'Duomen rinkinys apie aplinkos apsaugos ilaid sskaitose pateikiamus duomenis apie ilaidas aplinkos apsaugai, t.y. ekonominius iteklius, kuriuos alies kio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos ries, pervedim aplinkos apsaugai ries, sandorio ir sektoriaus dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: kio subjektai, skaitant nam kius.\r\n\r\nStatistin tiriamoji visuma: nam kiai, nefinansins bendrovs, valdios sektorius, likusio pasaulio sektorius: \r\n\r\n valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n nam kiai, valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaug vartotojai;\r\n\r\n likusio pasaulio sektorius kaip aplinkos apsaugai skirt pervedim gavjas arba moktojas.\r\n\r\nTiriami alies kio subjektai, vykdantys kasybos ir karjer eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, duj, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos ris pagal EVRK 2 red. Kit ekonomins veiklos ri (iskyrus valdios sektori) pagal EVRK 2 red. aplinkos apsaugos ilaidos nra vertinamos.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2503/'),
(76, 4, 'Investicijos  aplinkos apsaug', '2023-12-18', '2023-12-20', 'Duomen rinkinys apie aplinkos apsaugos ilaid sskaitose pateikiamus duomenis apie ilaidas aplinkos apsaugai, t.y. ekonominius iteklius, kuriuos alies kio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos ries ir investicij  aplinkos apsaug ries dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: kio subjektai, skaitant nam kius.\r\n\r\nStatistin tiriamoji visuma: nam kiai, nefinansins bendrovs, valdios sektorius, likusio pasaulio sektorius: \r\n\r\n valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n nam kiai, valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaug vartotojai;\r\n\r\n likusio pasaulio sektorius kaip aplinkos apsaugai skirt pervedim gavjas arba moktojas.\r\n\r\nTiriami alies kio subjektai, vykdantys kasybos ir karjer eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, duj, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos ris pagal EVRK 2 red. Kit ekonomins veiklos ri (iskyrus valdios sektori) pagal EVRK 2 red. aplinkos apsaugos ilaidos nra vertinamos.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2502/'),
(77, 4, 'Aplinkos apsaugos paslaug vartojimas', '2023-12-18', '2023-12-20', 'Duomen rinkinys apie aplinkos apsaugos ilaid sskaitose pateikiamus duomenis apie ilaidas aplinkos apsaugai, t.y. ekonominius iteklius, kuriuos alies kio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos ries ir aplinkos apsaugos paslaug vartojimo ries dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: kio subjektai, skaitant nam kius.\r\n\r\nStatistin tiriamoji visuma: nam kiai, nefinansins bendrovs, valdios sektorius, likusio pasaulio sektorius: \r\n\r\n valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n nam kiai, valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaug vartotojai;\r\n\r\n likusio pasaulio sektorius kaip aplinkos apsaugai skirt pervedim gavjas arba moktojas.\r\n\r\nTiriami alies kio subjektai, vykdantys kasybos ir karjer eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, duj, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos ris pagal EVRK 2 red. Kit ekonomins veiklos ri (iskyrus valdios sektori) pagal EVRK 2 red. aplinkos apsaugos ilaidos nra vertinamos.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2501/'),
(78, 4, 'Aplinkos apsaugos paslaug produkcija', '2023-12-18', '2023-12-19', 'Duomen rinkinys apie aplinkos apsaugos ilaid sskaitose pateikiamus duomenis apie ilaidas aplinkos apsaugai, t.y. ekonominius iteklius, kuriuos alies kio subjektai skiria aplinkos apsaugai. Pateikta per aplinkosaugos veiklos ries ir aplinkos apsaugos paslaug produkcijos ries dimensijas.\r\n\r\nNaudojami klasifikatoriai: Aplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000).\r\n\r\nStatistinio stebjimo vienetas: kio subjektai, skaitant nam kius.\r\n\r\nStatistin tiriamoji visuma: nam kiai, nefinansins bendrovs, valdios sektorius, likusio pasaulio sektorius: \r\n\r\n valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaugas teikiantys instituciniai sektoriai;\r\n\r\n nam kiai, valdios sektorius ir nefinansins bendrovs kaip aplinkos apsaugos paslaug vartotojai;\r\n\r\n likusio pasaulio sektorius kaip aplinkos apsaugai skirt pervedim gavjas arba moktojas.\r\n\r\nTiriami alies kio subjektai, vykdantys kasybos ir karjer eksploatavimo (sekcija B), apdirbamosios gamybos (sekcija C), elektros, duj, garo tiekimo ir oro kondicionavimo (sekcija D), vandens tiekimo, nuotek valymo, atliek tvarkymo ir regeneravimo (sekcija E), statybos (sekcija F), transporto ir saugojimo (sekcija H) veiklos ris pagal EVRK 2 red. Kit ekonomins veiklos ri (iskyrus valdios sektori) pagal EVRK 2 red. aplinkos apsaugos ilaidos nra vertinamos.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2010m., metinis.', 'https://data.gov.lt/datasets/2500/'),
(79, 4, 'BVP ilaid metodu, to meto kainomis', '2023-12-18', '2024-01-05', 'Statistins informacijos apraymas: bendrasis vidaus produktas (BVP)  vienas i pagrindini nacionalini sskait sistemos (NSS) rodikli, apibdinani alies ekonomikos isivystymo lyg. BVP, jo kitimo tempas ir bendrosios nacionalins pajamos (BNP) plaiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebjimo vienetas: nacionalins sskaitos, apimanios ekonomik kaip visum, kuri sudaro skirtingi instituciniai vienetai. Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. \r\nGeografin aprptis - alies ekonomin teritorija.\r\nLaiko aprptis - nuo 1995 m. \r\nMatavimo vienetas (-ai): BVP to meto kainomis  mln. EUR ir indeksai  proc.; Ataskaitinis laikotarpis: kalendoriniai metai.', 'https://data.gov.lt/datasets/2451/'),
(80, 4, 'BVP pajam metodu, to meto kainomis', '2023-12-18', '2024-01-05', 'Statistins informacijos apraym sudaro bendrasis vidaus produktas (BVP)  vienas i pagrindini nacionalini sskait sistemos (NSS) rodikli, apibdinani alies ekonomikos isivystymo lyg. BVP, jo kitimo tempas ir bendrosios nacionalins pajamos (BNP) plaiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti.\r\nNaudojami klasifikatorius: ekonomins veiklos ri klasifikatorius\r\nStatistinio stebjimo vienetas: nacionalins sskaitos apima ekonomik, kaip visum, kuri sudaro skirtingi instituciniai vienetai.\r\nStatistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Lietuvos nacionalins sskaitos yra isamios; t. y. visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomen altini (tyrim, administracini duomen) pagrindu arba per isamumo korekcijas.\r\nGeografin aprptis: alies ekonomin teritorija.\r\nLaiko aprptis:	nuo 2000 m. iki 2020 m.\r\nMatavimo vienetas (-ai): BVP to meto kainomis  mln. EUR;\r\nAtaskaitinis laikotarpis: kalendoriniai metai', 'https://data.gov.lt/datasets/2461/'),
(81, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal turto ir ekonomins veiklos ris (EVRK 2 red., 21),palyginamosiomis kainomis(grandininio susiejimo metodu) (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistin informacija - bendrojo pagrindinio kapitalo formavimas,  palyginamosiomis kainomis (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikr laikotarp gamintoj rezident sigyt ilgalaik turt, atmus pardavimus / perleidimus ir pridjus tam tikrus nesukurto turto verts padidjimus dl gamintojo arba institucini vienet gamybins veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995 m.', 'https://data.gov.lt/datasets/2460/'),
(82, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal turto ir ekonomins veiklos ris (EVRK 2 red., 21), to meto kainomis (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistin informacija - bendrojo pagrindinio kapitalo formavimas, to meto kainomis, pagal turto r, ekonomins veiklos r (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikr laikotarp gamintoj rezident sigyt ilgalaik turt, atmus pardavimus / perleidimus ir pridjus tam tikrus nesukurto turto verts padidjimus dl gamintojo arba institucini vienet gamybins veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995 m.', 'https://data.gov.lt/datasets/2459/'),
(83, 4, 'Bendrojo pagrindinio kapitalo formavimas pagal ekonomins veiklos ris (EVRK 2 red., 10) ir regionus, to meto kainomis (metinis)', '2023-12-18', '2023-12-20', 'Pateikiama statistin informacija - bendrojo pagrindinio kapitalo formavimas, to meto kainomis, regionais, ekonomins veiklos r (metinis). Bendrojo pagrindinio kapitalo formavimas apima per tam tikr laikotarp gamintoj rezident sigyt ilgalaik turt, atmus pardavimus / perleidimus ir pridjus tam tikrus nesukurto turto verts padidjimus dl gamintojo arba institucini vienet gamybins veiklos. Ilgalaikis turtas yra sukurtas turtas, daugiau nei vienus metus naudojamas gamybai. Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995 m.', 'https://data.gov.lt/datasets/2458/'),
(84, 4, 'Ivykusi turist nakvyni skaiius', '2023-12-18', '2024-01-05', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei kelioni ilaidas, lyt, ami. Pateikta per valstybs, kelions tikslo, apgyvendinimo staigos tipo, laikotarpio, amiaus dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018);\r\n\r\nPasaulio ali ir teritorij klasifikatorius.\r\n\r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio.\r\n\r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2005m., metiniai.', 'https://data.gov.lt/datasets/2448/'),
(85, 4, 'Bendrasis vidaus produktas vienam gyventojui pagal apskritis, to meto kainomis (metinis)', '2023-12-18', '2023-12-27', 'Pateikiama statistin informacija - bendrasis vidaus produktas tenkantis vienam gyventojui, to meto kainomis (metinis) , pagal apskritis. Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 2000 m.', 'https://data.gov.lt/datasets/2525/'),
(86, 4, 'Ivykusi turist kelioni skaiius', '2023-12-18', '2023-12-27', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, pagal lyt, pagal ami,pagal naudojam pagrindin transporto priemons r ir apgyvendinimo staigos  tip ir valstyb bei kelioni ilaidas. Pateikta per tikslo valstybs, kelions tikslo, apgyvendinimo staigos tipo, laikotarpio, amiaus dimensijas. Naudojami klasifikatoriai: Pasaulio ali ir teritorij klasifikatorius. Statistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio.. Statistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas. Geografin aprptis: visa alies ekonomin teritorija. Laiko aprptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2446/'),
(87, 4, 'Ivykusi turist skaiius', '2023-12-18', '2023-12-21', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, skaii, j kelioni, nakvyni skaii ir tikslus, naudojam pagrindin transporto priemons r ir apgyvendinimo tip kelionje bei kelioni ilaidas. Pateikta per tikslo valstybs, lyties, kelions tikslo dimensijas.\r\n\r\nNaudojami klasifikatoriai: \r\n\r\nPasaulio ali ir teritorij klasifikatorius.\r\n\r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio..\r\n\r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas.\r\n\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\n\r\nLaiko aprptis: nuo 2005m., ketvirtiniai ir metiniai.', 'https://data.gov.lt/datasets/2511/'),
(88, 4, 'Ivykusi turist ilaidos', '2023-12-18', '2024-01-05', 'Duomen rinkinys apie Lietuvos nuolatini gyventoj (toliau  gyventojai), keliaujani  usien, kelioni tikslus ir kelioni ilaidas bei apgyvendinimo trukm, valstybes. Pateikta per tikslo valstybs dimensijas.\r\nNaudojami klasifikatoriai: \r\nLietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018);\r\nPasaulio ali ir teritorij klasifikatorius.\r\nStatistinio stebjimo vienetas: vyresni nei 15 met amiaus gyventojai, grtantys i usienio.\r\nStatistin tiriamoji visuma: tiriamj visum sudaro gyventoj, grtani i usienio, kelions. Neskaitomos asmen kelions, kuri tikslas lankomoje teritorijoje yra apmokamas darbas.\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\nLaiko aprptis: nuo 2005m., ketvirtiniai.', 'https://data.gov.lt/datasets/2524/'),
(89, 4, 'BVP, to meto kainomis', '2023-12-18', '2023-12-27', 'Pateikiama statistin informacija - bendrasis vidaus produktas to meto kainomis pagal apskritis ir ilyginim (ketvirtinis, metinis). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995m', 'https://data.gov.lt/datasets/2455/'),
(90, 4, 'Pajamos u suteiktas apgyvendinimo paslaugas (be PVM)', '2023-12-18', '2023-12-29', 'Kas ketvirtins apgyvendinimo paslaug tiekj pajamos (be pvm) pagal apgyvendinimo tipus.\r\nApibrtys:\r\nApgyvendinimo staiga  vietos veiklos ries vienetas, teikiantis mokamas trumpalaikio apgyvendinimo paslaugas turistui. Pajamos u apgyvendinimo paslaugas  apgyvendinimo staigos pajamos, udirbtos per ataskaitin laikotarp u suteiktas apgyvendinimo paslaugas turistams. skaitomos pajamos u maitinimo, gydymo, reabilitacijos ir kitas turistams suteiktas paslaugas, jeigu jos skaitytos  apgyvendinimo paslaugos kain. Juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.2  poilsiautoj ir kita trumpalaikio apgyvendinimo veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3). Fiziniai asmenys, dirbantys pagal verslo liudijim (010, 043 kodai pagal Verslo liudijim klasifikatori) ar (ir) individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3) paslaugas turistams. \r\nLaiko aprptis nuo 2012 m.', 'https://data.gov.lt/datasets/2449/'),
(91, 4, 'Viet skaiius apgyvendinimo staigose', '2023-12-18', '2023-12-27', 'Pateikta statistin informacija apie viet skaii apgyvendinimo staigose, viebuio kategorij, apgyvendinimo tip, administracin teritorij, laikotarp (metus). Statistinio stebjimo vienetas - apgyvendinimo staiga (vietos veiklos ries vienetas). Tiriamj visum (populiacij) sudaro: juridiniai asmenys, teikiantys klasifikuojamsias* apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.3). Statistin informacija rengiama alies lygmeniu. Laiko aprptis - nuo 2012 m.\r\n\r\n*Pagal Turizmo statymo 31 straipsn apgyvendinimo paslaugos skirstomos : \r\n1) klasifikuojamsias apgyvendinimo paslaugas: motelio paslaugas, kempingo paslaugas, svei nam paslaugas, viebuio paslaugas; 2) neklasifikuojamsias apgyvendinimo paslaugas: jaunimo nakvyns nam (angl. hostel) paslaugas, kaimo turizmo paslaugas, poilsio nam paslaugas, privataus apgyvendinimo paslaugas, sanatorijos apgyvendinimo paslaugas, turistinio laivo apgyvendinimo paslaugas, turistins stovyklos paslaugas. Klasifikuojamsias apgyvendinimo paslaugas gali teikti apgyvendinimo paslaug teikjas, turintis io statymo 33 straipsnyje nustatyta tvarka iduot galiojant apgyvendinimo paslaug klasifikavimo paymjim. Minimalus klasifikuojamj apgyvendinimo paslaug klasifikuojamo objekto (toliau  klasifikuojamas objektas) kambari ar aikteli skaiius  ne maiau kaip 5 kambariai ar aiktels. Klasifikuojamosios apgyvendinimo paslaugos klasifikuojamos pagal ekonomikos ir inovacij ministro patvirtintus atitinkam apgyvendinimo paslaug klasifikavimo reikalavimus. Pagal teikiam paslaug kokyb ir vairov klasifikuojamj apgyvendinimo paslaug kokybs lygis enklinamas vaigdutmis, kuri didesnis skaiius reikia auktesn kokybs lyg. Aukiausias klasifikuojamj apgyvendinimo paslaug kokybs lygis ymimas penkiomis vaigdutmis. Viebuio paslaug kokybs lygis papildomai gali bti enklinamas pliuso enklu.', 'https://data.gov.lt/datasets/2453/'),
(92, 4, 'Numeri skaiius apgyvendinimo staigose', '2023-12-18', '2024-01-03', 'Pateikta statistin informacija apie viet skaii apgyvendinimo staigose pagal apgyvendinimo tip, administracin teritorij, viebuio kategorij, laikotarp (ketvirt, metin). Statistinio stebjimo vienetas - apgyvendinimo staiga (vietos veiklos ries vienetas). Naudojami klasifikatoriai: 1) Ekonomins veiklos ri klasifikatorius (EVRK 2 red.); 2) Lietuvos Respublikos administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018); 3) Verslo liudijim klasifikatorius. Tiriamj visum (populiacij) sudaro: 1) juridiniai asmenys, teikiantys apgyvendinimo paslaugas, nepriklausomai nuo pagrindins ekonomins veiklos ries pagal tokias EVRK 2 red. I sekcijos grupes: 55.1  viebui ir panai laikin buveini veikla, 55.2  poilsiautoj ir kita trumpalaikio apgyvendinimo veikla, 55.3  poilsini transporto priemoni, priekab aikteli ir stovyklaviei veikla (toliau  EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3); 2) fiziniai asmenys, dirbantys pagal verslo liudijim (010, 043 kodai pagal Verslo liudijim klasifikatori) ar (ir) individualios veiklos paym ir teikiantys apgyvendinimo veiklos (EVRK 2 red. I sekcija, grups 55.1, 55.2, 55.3) paslaugas turistams. Statistin informacija rengiama alies, region, apskrii ir savivaldybi lygmeniu. Laiko aprptis - nuo 2012 m.', 'https://data.gov.lt/datasets/2452/'),
(93, 4, 'Savinink uimt bst kain indekso svoriai', '2023-12-18', '2023-12-22', 'Rinkinyje pateikiama informacija apie savinink uimt bst kain indekso svorius. Svoris  procentais arba promilmis ireikta nam ki pinigini ilaid lyginamoji dalis tam tikrai BKI elementariajai visumai priklausantiems bstams su eme sigyti. Kuo didesnis svoris, tuo didesn tam tikro bsto su eme klasifikavimo lygio kain pokyio taka auktesnio bsto su eme klasifikavimo lygio kain pokyiui. Svori bazinis laikotarpis  laikotarpis, kurio duomenimis remiantis skaiiuojami indekso svoriai. SUBKI svori duomen altiniai  nacionalini sskait duomenys apie bendrojo pagrindinio kapitalo formavim naujiems bstams, V Registr centro Nekilnojamojo turto registro ir Sandori duomen bazs, Lietuvos banko duomenys apie bsto draudimo mokas ir imokas, eksperto parengta gyvenamj pastat smatin dokumentacija. SUBKI svori bazinis laikotarpis yra t2 metai, o BKI  t1 metai.', 'https://data.gov.lt/datasets/2523/'),
(94, 4, 'Savinink uimt bst kain indeksai', '2023-12-18', '2023-12-22', 'Savinink uimt bst kain indeksas (toliau  SUBKI)  santykinis rodiklis, kuriuo ireikiamas nam ki sektoriui nauj bst ir kit preki ir paslaug, kurias nam kiai perka kaip bsto savininkai, bendrasis kain pokytis. SUBKI sudarymo tikslas  turti su kitomis Europos Sjungos (ES) valstybmis narmis metodologikai suderint ir palyginam rodikl savinink uimt bst ir su bst sigijimu ir nuosavybe susijusi preki ir paslaug kain pokyiams vertinti. SUBKI reikalingas pinig politikai formuoti, infliacijos prognozms rengti ir alies finansiniam stabilumui vertinti. Sudarant SUBKI nam ki ilaidos bstams bei su j sigijimu ir nuosavybe susijusioms prekms ir paslaugoms sigyti klasifikuojamos  ilaid kategorijas, nurodytas 2020 m. liepos 31 d. Komisijos reglamente (ES) Nr. 2020/1148, kuriuo pagal Europos Parlamento ir Tarybos reglament (ES) 2016/792 nustatomos suderint vartotoj kain indeks ir bsto kain indekso metodins ir technins specifikacijos. SUBKI komponent kain subindeksams skaiiuoti naudojami ie klasifikatoriai: Ekonomins veiklos ri klasifikatorius (EVRK 2 red.); Statini pagal tip klasifikatorius (CC); Europos individualaus vartojimo ilaid pagal paskirt klasifikatorius (ECOICOP). Statistinio stebjimo vienetas - nam kio i kit sektori (juridinio asmens, valstybs, savivaldybi) alies ekonominje teritorijoje sigytas ar savininko pastatytas bstas ir su jo sigijimu ir nuosavybe susijusios preks ir paslaugos. Bst tiriamj visum sudaro alies rezident ir nerezident nam ki i kit sektori alies ekonominje teritorijoje sigyjami ar pai savinink pastatyti bstai. moni tiriamj visum sudaro mons, savo jgomis vykdanios gyvenamj nam statybos ir kapitalinio remonto darbus, prekybos mons, reprezentuojanios esam prekybos statybinmis mediagomis ir gaminiais moni tinkl, paslaug mons, teikianios su bsto sigijimu ir nuosavybe susijusias paslaugas (pvz., draudimo). Preki ir paslaug statistin visum sudaro su bsto sigijimu ir nuosavybe susijusios preks ir paslaugos. Duomenys renkami i visos alies ekonomins teritorijos nuo 2006m. I ketv. ir atnaujinami kas ketvirt. Pagrindinis statistini duomen altinis SUBKI skaiiuoti yra V Registr centro Nekilnojamojo turto registro ir Sandori duomen bazi, papildomai naudojami vartotoj kain, statybos snaud element kain, statybos darb kain statistini tyrim duomenys, alies teises aktai, kurie nustato su bst sigijimu ir nuosavybe susijusi paslaug kainas.', 'https://data.gov.lt/datasets/2522/'),
(95, 4, 'Bsto kain indekso svoriai', '2023-12-18', '2023-12-22', 'Rinkinyje pateikiami bsto kain indekso svoriai. Svoris  procentais arba promilmis ireikta nam ki pinigini ilaid lyginamoji dalis tam tikrai BKI elementariajai visumai priklausantiems bstams su eme sigyti. Kuo didesnis svoris, tuo didesn tam tikro bsto su eme klasifikavimo lygio kain pokyio taka auktesnio bsto su eme klasifikavimo lygio kain pokyiui. Svori bazinis laikotarpis  laikotarpis, kurio duomenimis remiantis skaiiuojami indekso svoriai. Atliekamos tokios gaut statistini duomen tikrinimo ir redagavimo procedros: atmetami sandoriai, kuriais sigyti bstai dl nepakankamo baigtumo lygio (< 80 proc.) yra netinkami gyventi, analizuojami kiekvienai elementariajai visumai priskirt bst pirkimopardavimo sandori duomenys, palyginti su ankstesni ketviri duomenimis. Duomen redagavimas ir patvirtinimas atliekamas naudojant kompiuterin kain statistini duomen tikrinimo program. Gautos kain kitimo tendencijos lyginamos su nekilnojamojo turto agentr ufiksuotomis bsto kain kitimo tendencijomis. Informacija apie veiksnius, turinius tak bsto kain pasikeitimui, reguliariai stebima spaudoje, kit moni ir institucij skelbiamose apvalgose ir ataskaitose. Pagrindinis statistini duomen altinis BKI apskaiiuoti yra V Registr centro Nekilnojamojo turto registro ir Sandori duomen bazi duomenys. altinio duomenys gaunami kas ketvirt. BKI bazinis laikotarpis yra 2015 m. (2015 m.  100). Kitas BKI bazinio laikotarpio keitimas numatytas 2026 m., buvusi laiko eilut bus perskaiiuota  nauj indekso bazin laikotarp ir paskelbta apskaiiavus 2026 m. I ketv. BKI.', 'https://data.gov.lt/datasets/2521/'),
(96, 4, 'Suderinto vartotoj kain indekso svoriai', '2023-12-15', '2023-12-22', 'Rinkinyje pateikiami suderinto vartotoj kain indeksos svoriai. Svoris  promilmis ireikta nam ki pinigini vartojimo ilaid lyginamoji dalis tam tikrai SVKI elementariajai visumai priklausanioms prekms ir paslaugoms sigyti. Kuo didesnis svoris, tuo didesn tam tikro preki ir paslaug klasifikavimo lygio kain pokyio taka auktesnio preki ir paslaug kain klasifikavimo lygio kain pokyiui. Pagrindiniai altiniai lyginamj svori sistemai parengti yra nacionalini sskait ir nam ki biudet statistinio tyrimo duomenys apie nam ki pinigines ilaidas vartojimo prekms ir paslaugoms sigyti. Lyginamj svori sistemai parengti naudojami ir kiti statistini duomen altiniai: neapskaitytoms nam ki ilaidoms vertinti  vidaus prekybos, transporto, turizmo, energetikos, socialins statistikos, kit institucij ir moni statistin informacija; alies nam ki ir lankytoj i usienio piniginms vartojimo ilaidoms detalizuoti  pramons, vidaus ir usienio prekybos, vietimo, transporto, turizmo statistikos, kit moni ir institucij statistiniai duomenys ir informacija. SVKI svoriai apskaiiuojami nuo 1996 m. sausio mn. ir apdorojami kas mnes.', 'https://data.gov.lt/datasets/2499/'),
(97, 4, 'Metinis nedarbo lygis', '2023-12-15', '2023-12-22', 'Metin vis nuolatini Lietuvos gyventoj statistin informacija apie bedarbi ir ekonomikai neaktyvi gyventoj skaii, j pasiskirstym pagal amiaus grupes, lyt, gyvenamj viet ir region nuo 1998 met. Rodiklis ireikiamas bedarbi ir darbo jgos santykiu. Naudojami LR Administracini vienet ir gyvenamj vietovi klasifikatorius (LR AVGVK 2018) ir Bendras teritorini statistini vienet klasifikatorius (NUTS).', 'https://data.gov.lt/datasets/2463/'),
(98, 4, 'S1 Visos ekonomikos nefinansins sskaitos', '2023-12-15', '2024-01-10', 'Statistins informacijos apraym sudaro nacionalins sskaitos  tarptautiniu mastu pripainta standartizuota statistini rodikli sistema, suteikianti galimyb isamiai atspindti nacionalins ekonomikos bkl bei pokyius ir metins nefinansins institucini sektori sskaitos (toliau  sskaitos), sudaromos pagal tarptautiniu mastu pripaint standartini statistini rodikli sistem, kuri isamiai nusako nacionalins ekonomikos vystymsi. Pagrindiniai sskait rodikliai vertinami remiantis Europos nacionalini ir regionini sskait sistema ESS 2010 (Europos Parlamento ir Tarybos reglamentas (ES) Nr. 549/2013 priedas A). Sskaitos, apima nefinansines sskaitas, kurios apibdina vairius ekonominio proceso etapus: gamybos, pajam formavimo, pajam paskirstymo, pajam perskirstymo, pajam panaudojimo ir nefinansinio kaupimo.\r\nKlasifikatoriai: institucini sektori ir subsektori klasifikatorius (Europos Parlamento ir Tarybos reglamento (ES) Nr. 549/2013 A priedas).\r\nStatistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai; ekonomika kaip visuma, sudaryta i vairi institucini vienet.\r\nLietuvos nacionalins sskaitos yra isamios; t. y. visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomen altini (tyrim, administracini duomen) pagrindu arba per isamumo korekcijas.\r\nGeografin aprptis: visa alies ekonomin teritorija.\r\nMatavimo vienetas (-ai): rodikliai ireikiami milijonais eur. \r\nLaiko aprptis: nuo 1995 m.; nuo 2000 m. iki 2020 m. \r\nAtaskaitinis laikotarpis: kalendoriniai metai.', 'https://data.gov.lt/datasets/2498/'),
(99, 4, 'Suderinti vartotoj kain indeksai (2015 m. - 100)', '2023-12-15', '2024-01-08', 'Suderintas vartotoj kain indeksas (SVKI) apskaiiuojamas pagal su kitomis Europos Sjungos (ES) valstybmis narmis suderint metodologij. SVKI naudojami infliacijai ES matuoti, palyginimams tarp ES valstybi nari atlikti, Europos centrinio banko pinig politikai vykdyti, Europos, pinig sjungos, Europos ekonomins erdvs vartotoj kain indeksams skaiiuoti, ES valstybi nari atitikiai kain stabilumo kriterijui vertinti (pagal Sutarties dl Europos Sjungos veikimo 140 straipsnio 1 dal ir Protokol Nr. 13 Dl konvergencijos kriterij). Rinkinyje naudojamas Europos individualaus vartojimo ilaid pagal paskirt (ECOICOP) klasifikatorius.  rinkin traukti visi alyje esantys nam kiai, skaitant alyje nuolat negyvenanius asmenis ir lankytojus i usienio; vartojimo preks ir paslaugos, kurias sigyja nam kiai. Statistinio stebjimo vienetas - vartojimo preks ir paslaugos, kurias alies nuolatiniai ir nenuolatiniai gyventojai sigyja prekybos ir paslaug monse ir vietos vienetuose individualiems vartojimo poreikiams tenkinti. moni ir vietos vienet tiriamj visum sudaro vis nuosavybs form, vairi tip, vairaus dydio prekybos ir paslaug mons ir vietos vienetai (2023 m. tiriamj imt sudaro apie 4 400 atrinkt moni ir vietos vienet). Preki ir paslaug statistin visum sudaro nam ki alies ekonominje teritorijoje sigyjamos vartojimo preks ir paslaugos (2023 m. tiriamj imt sudaro 982 reprezentatyvioji prek ir paslauga). Nam ki statistin visuma yra visi alyje esantys nam kiai skaitant institucinius nam kius, alyje nuolat negyvenanius asmenis ir lankytojus i usienio. Nam ki sektorius apima visus asmenis ar asmen grupes, neatsivelgiant  tai, kur jie gyvena, koki viet uima pajam pasiskirstyme, j tautyb bei pilietyb. SVKI aprpia nam ki pinigines vartojimo ilaidas alies ekonominje teritorijoje. SVKI apima vis alies ekonomin teritorij. J sudaro alies geografin teritorija, kuri administruoja alies vyriausyb ir kurioje laisvai juda asmenys, preks ir kapitalas. Lietuvos ekonomin teritorij SVKI reprezentuoja 18 teritorini vienet (10 apskrii ir 8 rajon centrai), atrinkt kainoms tirti. Kainos renkamos mauose, vidutiniuose ir 5 didiausiuose alies miestuose, kuri gyventoj skaiius sudaro nuo 5,5 tkst. (ma miest) iki 540 tkst. (didij miest) gyventoj. Maisto produkt, nealkoholini ir alkoholini grim bei tabako gamini kainos papildomai registruojamos 10 kaimo vietovi. Bazinis laikotarpis yra 2015 m. (2015 m.  100).', 'https://data.gov.lt/datasets/2497/'),
(100, 4, 'Suderinti vartotoj kain indeksai pagal pastovius mokesi tarifus (2015 m.  100)', '2023-12-15', '2023-12-22', 'Suderintas vartotoj kain indeksas (SVKI) apskaiiuojamas pagal su kitomis Europos Sjungos (ES) valstybmis narmis suderint metodologij. Rinkinyje pateikiamas SVKI pagal pastovius mokesi tarifus. SVKI naudojami infliacijai ES matuoti, palyginimams tarp ES valstybi nari atlikti, Europos centrinio banko pinig politikai vykdyti, Europos, pinig sjungos, Europos ekonomins erdvs vartotoj kain indeksams skaiiuoti, ES valstybi nari atitikiai kain stabilumo kriterijui vertinti (pagal Sutarties dl Europos Sjungos veikimo 140 straipsnio 1 dal ir Protokol Nr. 13 Dl konvergencijos kriterij). Rinkinyje naudojamas Europos individualaus vartojimo ilaid pagal paskirt (ECOICOP) klasifikatorius.  rinkin traukti visi alyje esantys nam kiai, skaitant alyje nuolat negyvenanius asmenis ir lankytojus i usienio; vartojimo preks ir paslaugos, kurias sigyja nam kiai. Statistinio stebjimo vienetas - vartojimo preks ir paslaugos, kurias alies nuolatiniai ir nenuolatiniai gyventojai sigyja prekybos ir paslaug monse ir vietos vienetuose individualiems vartojimo poreikiams tenkinti. moni ir vietos vienet tiriamj visum sudaro vis nuosavybs form, vairi tip, vairaus dydio prekybos ir paslaug mons ir vietos vienetai (2023 m. tiriamj imt sudaro apie 4 400 atrinkt moni ir vietos vienet). Preki ir paslaug statistin visum sudaro nam ki alies ekonominje teritorijoje sigyjamos vartojimo preks ir paslaugos (2023 m. tiriamj imt sudaro 982 reprezentatyvioji prek ir paslauga). Nam ki statistin visuma yra visi alyje esantys nam kiai skaitant institucinius nam kius, alyje nuolat negyvenanius asmenis ir lankytojus i usienio. Nam ki sektorius apima visus asmenis ar asmen grupes, neatsivelgiant  tai, kur jie gyvena, koki viet uima pajam pasiskirstyme, j tautyb bei pilietyb. SVKI aprpia nam ki pinigines vartojimo ilaidas alies ekonominje teritorijoje. SVKI apima vis alies ekonomin teritorij. J sudaro alies geografin teritorija, kuri administruoja alies vyriausyb ir kurioje laisvai juda asmenys, preks ir kapitalas. Lietuvos ekonomin teritorij SVKI reprezentuoja 18 teritorini vienet (10 apskrii ir 8 rajon centrai), atrinkt kainoms tirti. Kainos renkamos mauose, vidutiniuose ir 5 didiausiuose alies miestuose, kuri gyventoj skaiius sudaro nuo 5,5 tkst. (ma miest) iki 540 tkst. (didij miest) gyventoj. Maisto produkt, nealkoholini ir alkoholini grim bei tabako gamini kainos papildomai registruojamos 10 kaimo vietovi. Bazinis laikotarpis yra 2015 m. (2015 m.  100).', 'https://data.gov.lt/datasets/2496/'),
(101, 4, 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus uimtumas', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus uimtumas. 	\r\nalij preki ir paslaug sektoriaus sskait rengimo tikslas yra rinkti ir skelbti nacionalini ki gamybins veiklos, kuri vykdant sukuriami alieji produktai, statistik pagal iuos rodiklius:\r\n rinkos produkcija, i kurios eksportas, ne rinkos produkcija ir pagalbins veiklos produkcija,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos pridtin vert,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos uimtumas. \r\nNaudojami klasifikatoriai:\r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000);\r\nItekli valdymo veiklos klasifikatorius (CReMA)\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2490/'),
(102, 4, 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus produkcija', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus produkcija. 	\r\nalij preki ir paslaug sektoriaus sskait rengimo tikslas yra rinkti ir skelbti nacionalini ki gamybins veiklos, kuri vykdant sukuriami alieji produktai, statistik pagal iuos rodiklius:\r\n rinkos produkcija, i kurios eksportas, ne rinkos produkcija ir pagalbins veiklos produkcija,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos pridtin vert,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos uimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000);\r\nItekli valdymo veiklos klasifikatorius (CReMA)\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2489/');
INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(103, 4, 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus eksportas', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus eksportas. 	\r\nalij preki ir paslaug sektoriaus sskait rengimo tikslas yra rinkti ir skelbti nacionalini ki gamybins veiklos, kuri vykdant sukuriami alieji produktai, statistik pagal iuos rodiklius:\r\n rinkos produkcija, i kurios eksportas, ne rinkos produkcija ir pagalbins veiklos produkcija,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos pridtin vert,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos uimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000);\r\nItekli valdymo veiklos klasifikatorius (CReMA)\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2488/'),
(104, 4, 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus bendroji pridtin vert', '2023-12-15', '2024-01-03', 'Aplinkosaugos ir aplinkai palanki preki ir paslaug sektoriaus bendroji pridtin vert. 	\r\nalij preki ir paslaug sektoriaus sskait rengimo tikslas yra rinkti ir skelbti nacionalini ki gamybins veiklos, kuri vykdant sukuriami alieji produktai, statistik pagal iuos rodiklius:\r\n rinkos produkcija, i kurios eksportas, ne rinkos produkcija ir pagalbins veiklos produkcija,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos pridtin vert,\r\n rinkos veiklos, ne rinkos veiklos ir pagalbins veiklos uimtumas.\r\nNaudojami klasifikatoriai:\r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nAplinkos apsaugos veiklos ir ilaid klasifikatorius  (CEPA 2000);\r\nItekli valdymo veiklos klasifikatorius (CReMA)\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2010 m.', 'https://data.gov.lt/datasets/2487/'),
(105, 4, 'Su aplinka susij vartotoj mokesiai', '2023-12-15', '2023-12-22', 'Su aplinka susij vartotoj mokesiai (pagal vartotoj grupes). \r\nSu aplinka susijs mokestis  mokestis, kurio mokesio baz yra tam tikro rodyto specifinio neigiam poveik aplinkai turinio reikinio fizinis vienetas (ar fizinio vieneto pakaitinis rodiklis) ir kuris pagal Europos sskait sistem (ESS) yra priskiriamas mokesiams. \r\nSu aplinka susij mokesiai priskiriami ioms ESS 2010 kategorijoms: \r\n- gamybos ir importo mokesiai (D.2); \r\n- einamieji pajam, turto mokesiai ir kt. (D.5); \r\n- kapitalo mokesiai (D.91). \r\nNaudojami klasifikatoriai: \r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nGeografin aprptis: Visa alies ekonomin teritorija. \r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2486/'),
(106, 4, 'Su aplinka susij mokesiai', '2023-12-15', '2023-12-22', 'Su aplinka susij mokesiai pagal EVRK kodus. \r\nSu aplinka susijs mokestis  mokestis, kurio mokesio baz yra tam tikro rodyto specifinio neigiam poveik aplinkai turinio reikinio fizinis vienetas (ar fizinio vieneto pakaitinis rodiklis) ir kuris pagal Europos sskait sistem (ESS) yra priskiriamas mokesiams. \r\nSu aplinka susij mokesiai priskiriami ioms ESS 2010 kategorijoms: \r\n- gamybos ir importo mokesiai (D.2); \r\n- einamieji pajam, turto mokesiai ir kt. (D.5); \r\n- kapitalo mokesiai (D.91). \r\nNaudojami klasifikatoriai: \r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.);\r\nGeografin aprptis: Visa alies ekonomin teritorija. \r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2485/'),
(107, 4, 'Mediag vidaus vartojimas', '2023-12-15', '2023-12-22', 'Mediag vidaus vartojimas (bendras, metinis). \r\nMediag vidaus vartojimas (MVV) parodo vienet rezident bendr suvartojam mediag kiek.\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2484/'),
(108, 4, 'Mediag sraut sskaitos', '2023-12-15', '2023-12-22', 'Mediag sraut sskaitos (pagal aliav ir mediag ris).\r\nalies kio mediag sraut sskait (-MSS) sudarymo tikslas yra parengti su kitomis Europos Sjungos (ES) valstybmis narmis palyginamus rodiklius. -MSS tiesiogiai prisideda prie ES politikos prioritet, susijusi su aliojo augimo strategija ir efektyvaus itekli naudojimo iniciatyva, ir, pagal suderint su JT nacionalini sskait sistem (NSS) ir jos Europos versij (ESS), teikia informacij apie mediag srautus. MSS tinka integruotos aplinkos ir ekonomikos sveikos analizei ir modeliavimui.\r\nMediag vidaus vartojimas (MVV) parodo vienet rezident bendr suvartojam mediag kiek.\r\nVidaus mediag gavyba (VMG)  metinis kietj, skystj ir dujini mediag (iskyrus vanden) vienet rezident gaut i gamtins aplinkos ir skirt naudoti ekonominje veikloje, kiekis.\r\nPreki ir paslaug eksportas (PPE)  preki ir paslaug sandoriai (pardavimas, mainai, dovanojimas), kai rezidentai perleidia ekonomins nuosavybs teises nerezidentams.\r\nPreki ir paslaug importas (PPI)  preki ir paslaug sandoriai (pardavimas, mainai, dovanojimas), kai nerezidentai perleidia ekonomins nuosavybs teises rezidentams.\r\nTiesiogins mediag snaudos (TMS)  visos gamybai ir paslaugoms sunaudojamos mediagos, skaitant mediagas, sunaudotas importuojamiems gaminiams.\r\nNaudojami klasifikatoriai:\r\n-MSS Mediag tip klasifikatorius, pateikiamas 2011 m. liepos 6 d. Europos Parlamento ir Tarybos reglamento (ES) Nr. 691/2011 dl Europos aplinkos ekonomini sskait III priede.\r\nGeografin aprptis: Visa alies ekonomin teritorija\r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2483/'),
(109, 4, 'Mediag sraut pdsakas (aliav ekvivalentais)', '2023-12-15', '2023-12-22', 'Duomen rinkinys tiesiogiai prisideda prie ES politikos prioritet, susijusi su aliojo augimo strategija ir efektyvaus itekli naudojimo iniciatyva, ir, pagal suderint su JT nacionalini sskait sistem (NSS) ir jos Europos versij (ESS), teikia informacij apie mediag srautus.\r\nNaudojami klasifikatoriai: -MSS Mediag tip klasifikatorius, pateikiamas 2011 m. liepos 6 d. Europos Parlamento ir Tarybos reglamento (ES) Nr. 691/2011 dl Europos aplinkos ekonomini sskait III priede.\r\nStatistinio stebjimo vienetas: alies kis\r\nStatistin tiriamoji visuma:  -MSS traukiamos visos kietosios, dujins ir skystosios mediagos, iskyrus oro ir vandens srautus, kurios matuojamos tkstaniais ton per metus.\r\n-MSS sistemoje yra du mediag sraut, kertani sistemos ribas, tipai: \r\nmediag srautai tarp nacionalinio kio ir jo gamtins aplinkos. Tai mediag (t. y. ali, gryn ar neapdorot) gavyba i gamtins aplinkos ir mediag (danai vadinam atliekomis) alinimas ioje aplinkoje;\r\nmediag srautai tarp alies kio ir kit pasaulio ali ki. Tai apima import ir eksport.  -MSS traukiami ias sistem ribas kertantys srautai, taip pat moni sukurt atsarg papildymai. Visi kiti alies kio mediag srautai -MSS nenurodomi. Tai reikia, kad -MSS sistemoje nacionalinis kis laikomas visuma ir, pavyzdiui, produkt pristatymas i vieno sektoriaus  kit nra apraomas. Taip pat netraukiami ir natrals srautai gamtinje aplinkoje. \r\nEkonomikos sektorius traktuojamas kaip juodoji d ir mediag sraut transformacija ar persiskirstymas jos viduje neanalizuojamas, o apsiribojama tik einaniais ir ieinaniais mediag srautais.\r\nGeografin aprptis: visa alies ekonomin teritorija\r\nLaiko aprptis: nuo 2008 m.', 'https://data.gov.lt/datasets/2482/'),
(110, 4, 'Teral imetimas  atmosfer', '2023-12-15', '2023-12-20', 'Teral imetimas  atmosfer pagal EVRK kodus.  or imetami teralai  i nacionalinio kio (gamybos ar vartojimo proces)  atmosfer (kuri yra aplinkos dalis) patenkantis fizinis dujini ar kietj daleli mediag srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nEkonomins veiklos ri klasifikatorius (EVRK 2 red.)\r\n\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dl Europos aplinkos ekonomini sskait, rengiami statistiniai duomenys apie iuos  or imetamus teralus: anglies dioksid (CO2), iskyrus isiskiriant i biomass; anglies dioksid i biomass (biomass CO2); azoto oksid (N2O); metan (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluorid (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksid (CO); kietsias daleles < 10 mikron (PM10); kietsias daleles < 2,5 mikron (PM2,5); sieros dioksid (SO2); amoniak (NH3).\r\n\r\nGeografin aprptis: Visa alies teritorija\r\n\r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2481/'),
(111, 4, 'Nam ki teral kiekis, imestas  atmosfer', '2023-12-15', '2023-12-20', 'Nam ki teral kiekis, imestas  atmosfer.  or imetami teralai  i nacionalinio kio (gamybos ar vartojimo proces)  atmosfer (kuri yra aplinkos dalis) patenkantis fizinis dujini ar kietj daleli mediag srautas.\r\n\r\nNaudojami klasifikatoriai:\r\nRemiantis Europos Parlamento ir Tarybos Reglamentu (ES) Nr. 691/2011 dl Europos aplinkos ekonomini sskait, rengiami statistiniai duomenys apie iuos  or imetamus teralus: anglies dioksid (CO2), iskyrus isiskiriant i biomass; anglies dioksid i biomass (biomass CO2); azoto oksid (N2O); metan (CH4); perfluorangliavandenilius (PFCs); hidrofluorangliavandenilius (HFCs); sieros heksafluorid (SF6); azoto oksidus (NOx); nemetano lakiuosius organinius junginius (NMVOCs); anglies monoksid (CO); kietsias daleles < 10 mikron (PM10); kietsias daleles < 2,5 mikron (PM2,5); sieros dioksid (SO2); amoniak (NH3).\r\n\r\nGeografin aprptis: Visa alies teritorija\r\n\r\nLaiko aprptis: Nuo 2008 m.', 'https://data.gov.lt/datasets/2480/'),
(112, 4, 'BVP indeksai', '2023-12-15', '2024-01-05', 'Statistins informacijos apraymas: bendrasis vidaus produktas (BVP)  vienas i pagrindini nacionalini sskait sistemos (NSS) rodikli, apibdinani alies ekonomikos isivystymo lyg. BVP, jo kitimo tempas ir bendrosios nacionalins pajamos (BNP) plaiai naudojami tarptautiniams palyginimams ir ekonominei analizei atlikti. Statistinio stebjimo vienetas: nacionalins sskaitos, apimanios ekonomik, kaip visum, kuri sudaro skirtingi instituciniai vienetai. Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Lietuvos nacionalins sskaitos yra isamios, t. y., visi statistiniai vienetai rezidentai yra apimami tiesiogiai duomen altini (tyrim, administracini duomen) pagrindu arba per isamumo korekcijas. Geografin aprptis: alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1995 m. I ketvirio. \r\nMatavimo vienetas (-ai): indeksai  proc.\r\nAtaskaitinis laikotarpis: kalendorinis ketvirtis.', 'https://data.gov.lt/datasets/2472/'),
(113, 13, 'Hidrologiniai stebjimai', '2023-12-14', '2024-02-27', 'Prieiga prie 95 vandens matavimo stoi 30 dien hidrologini stebjim duomen. Duomenis sudaro valandiniai vandens lygio ir vandens temperatros duomenys. Daugiau informacijos  api.meteo.lt', 'https://data.gov.lt/datasets/2462/'),
(114, 4, 'B1g Bendroji pridtin vert,  palyginamosiomis kainomis (grandininio susiejimo metodu)', '2023-12-14', '2023-12-20', 'Pateikiama statistin informacija - bendroji pridtin vert (BPV) , palyginamosiomis kainomis (grandininio susiejimo metodu) pagal ekonomins veiklos ris, ilygininm (ketvirtinis, metinis) . Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995 m.', 'https://data.gov.lt/datasets/2457/'),
(115, 4, 'B1g Bendroji pridtin vert, to meto kainomis', '2023-12-14', '2023-12-27', 'Pateikiama statistin informacija - bendroji pridtin vert (BPV) , palyginamosiomis kainomis (grandininio susiejimo metodu), pagal ekonomins veiklos r, apskritis ilyginim, (ketvirtinis, metinis). Naudojamas Ekonomins veiklos ri klasifikatorius (https://osp.stat.gov.lt/klasifikatoriai?portletFormName=FPKL500&classifier-version=50&tab=version). Statistin (tiriamj) visum sudaro visi statistiniai stebjimo vienetai rezidentai. Geografin aprptis - alies ekonomin teritorija.  Laiko aprptis nuo 1995 m.', 'https://data.gov.lt/datasets/2456/'),
(116, 4, 'Energijos suvartojimas', '2023-12-14', '2023-12-22', 'Fizini energijos sraut sskait (FESS) rengimo tikslas  parengti tiksli ir palyginam statistin informacij apie gamtini energijos itekli, energetikos produkt, energetini liekan fizinius energijos srautus, patenkanius  nacionalin k, cirkuliuojanius kyje ir patenkanius  kitus kius arba  aplink. Tyrimas aprpia visas ekonomins veiklos ris pagal EVRK 2 red. Statistinio stebjimo vienetas - kio subjektas, skaitant nam k. Statistin tiriamoji visuma - alies venetai rezidentai ir nerezidentai, kurie gali bti ir juridiniai vienetai, ir fiziniai asmenys.', 'https://data.gov.lt/datasets/2441/'),
(117, 14, 'AB Keli prieira\" karjerai', '2023-12-13', '2023-12-13', 'AB Keli prieira\" veikloje eksploatuojam karjer lokacij duomenys.', 'https://data.gov.lt/datasets/2439/'),
(118, 14, 'Lietuvos valstybini keli prieiros lygiai.', '2023-12-12', '2023-12-12', 'Duomenys yra apie Keli prieiros priirimus valstybins reikms kelius. Savivaldybi vietins reikms keli informacijos duomenyse nra. \r\n\r\nKeli prieira vykdoma pagal Lietuvos automobili keli direkcijos parengtus reikalavimus  Keli prieiros vadov.\r\n\r\nLietuvos valstybins reikms keliai, atsivelgiant  eismo intensyvum ir svarb, yra suskirstyti : magistralinius, krato ir rajoninius kelius. iemos prieiros darbai skirstomi  prieiros lygius: I, II ir III.\r\n\r\n---\r\nhttp://kpl.keliuprieziura.lt/', 'https://data.gov.lt/datasets/2438/'),
(119, 8, 'Statiniai ir su jais susij dokumentai Lietuvos Respublikos statybos leidim ir statybos valstybins prieiros informacinje sistemoje Infostatyba', '2023-12-05', '2023-12-05', 'Atveriam duomen objektas - IS \"Infostatyba\"statiniai ir su jais susij projekt duomenys bei kiti su statiniais susij dokumentai.', 'https://data.gov.lt/datasets/1000/'),
(120, 15, 'Ataskaita apie perkanij organizacij vykdytus pirkimus per CPO LT el. katalog 2023 m. III ketv.', '2023-12-04', '2023-12-04', '', 'https://data.gov.lt/datasets/2386/'),
(121, 16, 'SARS-CoV-2 copy number in wastewater samples', '2023-11-24', '2023-11-30', '', 'https://data.gov.lt/datasets/2384/'),
(122, 17, 'Respublikinio Priklausomybs Lig Centro student, atliekani praktik gydymo staigoje, duomenys', '2023-11-08', '2023-12-01', 'iame duomen rinkinyje pateikiami student atlikusi praktik ar savanorik veikl RPLC duomenys.', 'https://data.gov.lt/datasets/2383/'),
(123, 17, 'Respublikinio Priklausomybs Lig Centro Vilniaus filialo stacionaro skyriuose gydyt pacient duomenys', '2023-11-08', '2023-12-12', 'iame duomen rinkinyje  pateikiami RPLC Vilniaus filiale stacionarines paslaugas gavusi pacient duomenys.', 'https://data.gov.lt/datasets/2382/'),
(124, 17, 'Respublikinio Priklausomybs Lig Centro Vilniaus filialo ambulatorini skyri pacient apsilankym duomenys', '2023-11-08', '2023-12-12', 'iame duomen rinkinyje  pateikiami RPLC Vilniaus filiale ambulatorines paslaugas gavusi pacient duomenys.', 'https://data.gov.lt/datasets/2381/'),
(125, 4, 'Gamintoj parduotos pramons produkcijos kain indeksai (2015 m. - 100)', '2023-10-30', '2023-12-27', 'Rinkinyje pateikiami duomenys apie Lietuvos gamintoj parduotos pramons produkcijos bendr kain pokyt per mnesio laikotarp. Rinkinys reikalingas vairiems rodikliams palyginamosiomis kainomis skaiiuoti, ekonomikos raidai analizuoti, Lietuvos gamintoj parduotos pramons produkcijos kain pokyiams vertinti. Pateikta per Ekonomins veiklos ries (EVRK 2 red.) ir rinkos dimensijas. \r\nNaudojami klasifikatoriai: \r\n1) Produkt, gamini ir paslaug klasifikatorius (PGPK 2019); \r\n2) Ekonomins veiklos ri klasifikatorius (EVRK 2 red.); \r\n3) Pasaulio ali ir teritorij klasifikatorius. \r\nStatistinio stebjimo vienetas: mon. \r\nStatistin tiriamoji visuma: atrenkamos vairi nuosavybs form mons, kurios vykdo pramonin veikl. Tai mons gamintojos, kuri parduotos Lietuvos ir ne Lietuvos rinkoje pramons produkcijos apimtis sudaro didel atitinkamos gamini kategorijos (10 enkl lygiu pagal PGPK 2019) parduotos produkcijos dal. \r\nGeografin aprptis: Visa alies ekonomin teritorija. \r\nLaiko aprptis: nuo 1998 m. sausio mn. \r\nPeriodikumas  mnesinis.', 'https://data.gov.lt/datasets/2379/'),
(126, 18, 'Humanitarins pagalbos teikimas treiosioms alims', '2023-10-26', '2023-11-29', 'Sveikatos apsaugos ministerijos Ekstremali sveikatai situacij centras atsivelgdamas  ali, kurios susiduria su nenumatytomis grsmmis ir krizmis bei negali paios susidoroti su j padariniais savo jgomis, pagalbos praymus, inicijuoja humanitarin ir civilin pagalb medicinos ranga, asmens apsaugos priemonmis, vaistais bei vakcinomis. Duomenys apie suteikt humanitarin ar civilin pagalb atveriami du kartus per metus. ali ir institucij bendradarbiavimas, dalijimasis patirtimi ir itekliais padeda greiiau ir veiksmingiau reaguoti  ekstremalias situacijas. Atveriami duomenys suteikia galimyb vertinti kaip yra panaudojami valstybs resursai, paskirstomos los, utikrinti, kad parama bt teikiama nealikai ir skaidriai. Paramos teikimo metu gytos inios padeda gerinti humanitarins ir civilins pagalbos teikimo mechanizm Lietuvoje.', 'https://data.gov.lt/datasets/2378/'),
(127, 18, 'Gyventoj aprpinimas stabiliojo jodo preparatais pagal savivaldybes', '2023-10-18', '2023-11-29', 'Sveikatos apsaugos ministerijos Ekstremali sveikatai situacij centras, vykdydamas gyventoj aprpinimo kalio jodidu stebsen, ne reiau kaip kart per eis mnesius (einamj met balandio 1 d. ir spalio 1 d.)  surenka informacij apie gyventoj aprpinim kalio jodidu i 16 savivaldybi, kuri teritorijos patenka  skubi apsaugomj veiksm zon (30 km) ir  iplstinio planavimo atstum nuo Baltarusijos atomins elektrins.', 'https://data.gov.lt/datasets/2371/'),
(128, 2, 'Nestatutini valstybs tarnautoj pareigybi statistika', '2023-10-13', '2023-11-06', 'Aktuali nestatutini valstybs tarnautoj pareigybi statistika pagal Valstybs ir savivaldybi institucijas bei staigas. Pareigybi statistika skaiiuojama kaip steigt pareigybi suma (sumuojant etatus, nes pareigyb gali sudaryti ir ne piln etat). Pareigybs - tai staigos turimos ar suplanuotos, bet nebtinai upildytos vairi tip darbo pozicijos; steigt pareigybi skaiius gali skirtis nuo uimt pareigybi skaiiaus ar tarnautoj skaiiaus. Nestatutiniai valstybs tarnautojai - tai, pvz., staig vadovai, patarjai, padjjai, specialistai; daniausiai tai nra visi staigoje dirbantys darbuotojai. Duomen altinis - VATIS ir VATARAS. Rodomos tik iuo metu egzistuojanios staigos, turinios bent vien tokio tipo pareigyb. Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1240/'),
(129, 2, 'Aktuals darbo skelbimai vieajame sektoriuje', '2023-10-13', '2023-11-06', 'Valstybs tarnybos portale vieinami konkursai bei atrankos  valstybs ir savivaldybi institucij bei staig laisvas darbo pozicijas. Trys darbo skelbim kategorijos: 1) Konkurs  karjeros valstybs tarnautoj pareigas skelbimai; 2) Atrank  pakaitini valstybs tarnautoj pareigas skelbimai; 3) Konkurs  darbuotoj, dirbani pagal darbo sutart, pareigas skelbimai. Pateikiami tik galiojantys (aktuals) skelbimai. Lentel atnaujinama kas dien. Atlyginimo apskaiiavime naudojamas 2023 m. pareigins algos bazinis dydis (nuo 2024 m. keisis skaiiavimo metodika). Detalesn skelbim informacij galima surasti https://portalas.vtd.lt/, iekant pagal skelbimo numer. Duomen altinis - VATIS ir VATARAS. Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1241/'),
(130, 2, 'Valstybs ir savivaldybi institucijos bei staigos,j pavaldumas', '2023-10-13', '2023-11-06', 'Aktualus ir isamus valstybs ir savivaldybi institucij bei staig sraas,i staig pavaldumas viena kitai. Duomen altinis - VATIS ir VATARAS. Pateikiamos tik iuo metu egzistuojanios staigos. Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1239/'),
(131, 19, 'Azartini loim verslo loterij ir loim mokesio duomenys', '2023-10-11', '2024-01-10', 'Azartini loim organizatori  deklaruot ios veiklos mokesi (form FR0584) duomenys', 'https://data.gov.lt/datasets/1923/'),
(132, 20, 'Keli naudotojo mokesio sumokjimo duomenys', '2023-10-11', '2024-02-15', 'Transporto priemoni, u kurias sumoktas keli naudotojo mokestis, duomenys: transporto priemons registracijos alis, transporto priemons techniniai parametrai\n--\nhttps://keliumokestis.lt', 'https://data.gov.lt/datasets/1256/'),
(133, 19, 'Juridini asmen sumokti mokesiai', '2023-10-11', '2024-02-14', 'Duomenys apie juridini asmen sumoktus prajusiais metais ir einamaisiais metais  Valstybins mokesi inspekcijos biudeto pajam surenkamsias sskaitas deklaruojamus mokesius ir rinkliavas, kurie nurodyti Lietuvos Respublikos Mokesi administravimo statymo 13 straipsnyje. Einamaisiais metais sumoktos mokesi sumos skaiiuojamos kaupimo bdu nuo met pradios iki ataskaitinio laikotarpio pabaigos. Duomenys atnaujinami vien kart per mnes.', 'https://data.gov.lt/datasets/673/'),
(134, 21, 'Lietuvos bioetikos komiteto iduoti leidimai atlikti biomedicininius tyrimus ir iduoti pritarim atlikti klinikin vaistinio preparato tyrim liudijimai', '2023-10-10', '2023-10-14', 'Skelbiama informacija apie Lietuvos bioetikos komiteto iduotus leidimus atlikti biomedicininius tyrimus ir iduotus pritarim atlikti klinikin vaistinio preparato tyrim liudijimus', 'https://data.gov.lt/datasets/729/'),
(135, 4, 'Ekonomins veiklos ri klasifikatorius (EVRK 2 red.)', '2023-10-10', '2023-10-31', 'Ekonomins veiklos ri klasifikatorius (EVRK 2 red.) parengtas pagal Europos Sjungos Statistikos Tarnybos (EUROSTAT) paruot klasifikatori Nomenclatures des Activities de Communite Europeene - NACE rev. 2 (Statistinis Europos Bendrijos ekonomins veiklos ri klasifikatorius - NACE 2 red. ). EVRK2 red. nustato atskir kategorij veiklos sritis, kodus, pavadinimus, t. y. sekcijas, skyrius, grupes, klases, visoms Europos Sjungos alims narms.', 'https://data.gov.lt/datasets/1927/'),
(136, 22, 'Pacient ambulatoriniai apsilankymai pagal savivaldybes', '2023-10-10', '2024-01-17', 'Informacija apie pacient ambulatorini apsilankym skaii pagal savivaldybes 2022 m.', 'https://data.gov.lt/datasets/2272/'),
(137, 5, 'Adres registro ems sklypams, pastatams ir patalpoms suteikt adres tekstiniai duomenys', '2023-10-09', '2024-02-29', 'ems sklypams, pastatams ir patalpoms  suteikt adres tekstini duomen rinkinys i Lietuvos Respublikos adres registro (ems sklypams ar pastatams suteiktus adresus apibdinantys duomenys). Duomen geografin imtis  visa alies teritorija.', 'https://data.gov.lt/datasets/2369/'),
(138, 23, 'Geleinkeli transporto sukeliamo triukmo duomenys', '2023-10-06', '2023-11-28', 'Geleinkeli transporto sukeliamo triukmo duomenys pagrindinse linijose, ne aglomeracijos zonose', 'https://data.gov.lt/datasets/2092/'),
(139, 23, 'Keli transporto veiklos licencijos', '2023-10-04', '2023-11-28', 'Keli transporto veiklos licencijos', 'https://data.gov.lt/datasets/2335/'),
