(211, 36, 'Atvir duomen atvrimo paangos ir poveikio vertinimo apklausos duomenys', '2023-08-24', '2024-01-19', 'Siekiant  vertinti esam duomen atvrimo progres ir nustatyti  esam duomen atvrimo situacij vieojo sektoriaus institucijose ir savivaldybse, Ekonomikos ir inovacij ministerija ir Informacins visuomens pltros komitetas atliko duomen atvrimo paangos ir poveikio vertinimo apklaus. Apklausos vykdymo laikas 2022 m. gegus-rugsjo mn. Apklausoje dalyvavo 165 valstybs ir savivaldybi institucijos bei staigos.', 'https://data.gov.lt/datasets/2359/'),
(212, 37, 'Leidim kirsti mik statistika', '2023-08-21', '2023-12-12', 'Leidim kirsti mik statistika nuo 2005 m.', 'https://data.gov.lt/datasets/2121/'),
(213, 31, 'Gydymo staig, vaistini ir kit moni sraas', '2023-08-16', '2023-12-12', 'Informacija apie gydymo staigas, vaistines ir kitas mones. Informacija paimta i IS METAS.', 'https://data.gov.lt/datasets/1386/'),
(214, 2, 'Keli eismo taisykli paeidimai ir paeidjai', '2023-08-14', '2023-11-06', 'Administracini nusiengim registro (ANR) duomen neagreguota lentel (mikroduomenys), kurioje traukti tik tie nusiengimai, kuri sudt nustatantys Administracini nusiengim kodekso (ANK) straipsniai yra susij su Keli eismo taisykli (KET) paeidimais (straipsniai 414-433, 439-441, 463). Viena eilut yra vieno administracinio nusiengimo vieno straipsnio viena dalis, tad vienas nusiengimas gali kartotis daugelyje eilui. Kievienam nusiengimui yra priskirtas paeidjas (taiau bna nemaai atvej, kuomet paeidjo duomen nra). Paeidjo duomenys nra laikytini grietai patikimais. Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1234/'),
(215, 2, 'Administracini nusiengim detali mnesin statistika', '2023-08-14', '2023-11-06', 'Administracini nusiengim registro (ANR) mnesiniai statistiniai duomenys apie registruotus administracinius nusiengimus. Tai yra agreguota lentel: pateikiami nusiengim skaiiai Administracini nusiengim kodekso (ANK) straipsnio bei nusiengimo registracijos mnesio grupse. Vieno nusiengimo sudtyje gali bti keli ANK straipsniai, todl stulpelio count negalima sumuoti, prasminga yra skaiiuoti count/total santyk. Dmesio: tai nra oficialioji statistika, ia naudojama eksperimentin duomen paruoimo metodika (pvz., neatsivelgiama  galimus tolimesnius nusiengimo statuso pasikeitimus). Rinkinio paskirtis - bendroms laiko tendencijoms stebti. Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/1232/'),
(216, 36, 'Vieosios nuomons tyrimas apie 20142020 m. Europos Sjungos investicijas', '2023-08-10', '2023-10-14', 'Tyrimo tikslas  nustatyti tarpines komunikacijos rodikli, nurodyt Komunikacijos plane, reikmes, pateikti tyrimo rezultatus ir vertinti esam situacij atsivelgiant  20142020 m. Europos Sjungos fond investicij komunikacijos rodiklius, u kuriuos yra atsakinga Ekonomikos ir inovacij ministerija.\nTikslins grups: moni vadovai ir moni atstovai. Visos tikslins grups skirstomos pagal kriterijus: Labai maos, maos ir vidutins mons; Didels mons; Pagal apskritis ir jose esanias savivaldybes; Pagal veikl (paslaug mon, gamybos mon, prekybos mon ar kita veikla).\nApklausos metodas - Kombinuotas tyrimo metodas: CAWI (Computer Assisted Web Interview) ir CATI (Computer Assisted Telephone Interview). \nAtranka - Tyrime naudojamas kvotins atrankos metodas, taikant mons dydio, veiklos srities ir lokacijos (apskritis) kvotas.\nImtis - 500 moni vadov ir 500 moni atstov (darbuotoj).\nRezultatai - pateikiamos ataskaitos pdf formatu ir apibendrint duomen lentels.\nTyrimo laikotarpis - 2016-2023 m.', 'https://data.gov.lt/datasets/2358/'),
(217, 38, 'Licencij verstis mamenine prekyba tabako gaminiais sraas', '2023-08-10', '2023-10-14', 'Licencij verstis mamenine prekyba tabako gaminiais sraas', 'https://data.gov.lt/datasets/2357/'),
(218, 38, 'Licencij verstis mamenine prekyba alkoholiniais grimais sraas', '2023-08-10', '2023-10-14', 'Licencij verstis mamenine prekyba alkoholiniais grimais sraas', 'https://data.gov.lt/datasets/2356/'),
(219, 2, 'Administracini nusiengim bylose paskirtos baudos', '2023-08-04', '2024-03-12', 'Administracini nusiengim registro (ANR) duomen neagreguota lentel (mikroduomenys), kurioje viena eilut yra vienas administracinis nusiengimas, u kur yra paskirta bauda (administracins nuobaudos ris). iuo metu yra traukiami tik tokie nusiengimai, kuri sudtyje yra tik vienas Administracini nusiengim kodekso (ANK) straipsnis ir tik viena pinigin bauda. Paskirtos baudos nebtinai yra apmoktos. Taip pat dalis  imt patenkani nusiengim yra tie, dl kuri priimti nutarimai gali bti apsksti, nutraukti ar perkvalifikuoti (i informacija nepateikiama). Dmesio: tai nra oficialioji statistika, naudojama eksperimentin duomen paruoimo metodika (pvz., neatsivelgiama  galimus tolimesnius nusiengimo statuso pasikeitimus). Dl technini klausim kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2355/'),
(220, 39, 'Vilniaus miesto adres duomenys', '2023-08-03', '2023-10-14', 'Vilniaus miesto gatvi duomen rinkinys i Vilniaus savivaldybs adres registro. Duomen geografin imtis - Vilniaus miestas.', 'https://data.gov.lt/datasets/2353/'),
(221, 39, 'Vilniaus miesto dokument valdymo sistemos gaunami dokumentai', '2023-08-03', '2023-10-14', 'Duomen rinkinys apima  Vilniaus miesto dokument valdymo sistem gaunamus dokumentus, suteikianius verting valg apie administracinius procesus ir komunikacij miesto valdyme.', 'https://data.gov.lt/datasets/2354/'),
(222, 40, 'Atlikt inspektavim duomenys', '2023-08-02', '2023-10-14', 'VDI atlikt planini ir neplanini inspektavim pagal tikrinim ru skaiius', 'https://data.gov.lt/datasets/270/');
