(288, 5, 'e. Recepto posistems duomenys apie gydytoj skirtus receptinius vaistus', '2023-07-24', '2024-03-08', 'e.Sveikatos (Elektronins sveikatos paslaug ir bendradarbiavimo infrastruktros informacins sistemos) e.Recepto posistems duomenys apie gydytoj skirtus receptinius vaistus*. \r\nTerminas VAISTAS iame duomen rinkinyje naudojamas kaip bendrinis pavadinimas visiems su receptu skiriamiems medicininiams produktams (vaistinis preparatas, medicinos pagalbos priemon (MPP), vardinis vaistas, ekstemporalus vaistas, kitos priemons).\r\n\r\nDuomen nuasmeninimo kriterijai:		\r\n1.    Jeigu per ketvirt vienam TLK-10-AM kodui irayt recept skaiius yra maesnis nei 10, duomen rinkinyje pateikiamas tik dirbtinis irayto recepto identifikatorius, recepto iraymo metai bei ketvirtis ir diagnozs (TLK-10-AM klasifikatoriaus), pagal kuri iraytas receptas, kodas bei pavadinimas. 		\r\n2.    Jeigu per ketvirt vienam TLK-10-AM kodui vienoje savivaldybje, kurioje yra recept iraiusi gydymo staiga, irayt recept skaiius yra maesnis nei 5,  staigos, kurioje buvo iraytas receptas, savivaldyb nenurodoma.		\r\n3.    Jeigu per ketvirt vienam TLK-10-AM kodui vienoje savivaldybje, kurioje pacientas yra deklaravs gyvenamj viet, irayt recept skaiius yra maesnis nei 5,  paciento deklaruotos gyvenamosios vietos savivaldyb nenurodoma.		\r\n4.    Jeigu per ketvirt vienoje savivaldybje, kurioje yra recept iraiusi gydymo staiga, receptus iraiusi gydytoj, turini t pai kvalifikacij, skaiius yra maesnis nei 3, gydytojo kvalifikacija nenurodoma.', 'https://data.gov.lt/datasets/2020/'),
(289, 5, 'Likviduoto hipotekos registro (HR) archyviniai duomenys apie sandorius', '2023-07-24', '2023-11-23', 'HR archyviniai duomenys apie sandorius (pagal hipotekos sandori ris, vert ir kt.). Likviduoto Lietuvos Respublikos hipotekos registro (HR) archyviniai duomenys.', 'https://data.gov.lt/datasets/1996/'),
(290, 5, 'Likviduoto hipotekos registro (HR) archyviniai duomenys apie keistus objektus', '2023-07-24', '2023-11-23', 'HR archyviniai duomenys apie keistus objektus (HR keistus objektus (turto r) apibdinantys poymiai). Likviduoto Lietuvos Respublikos hipotekos registro (HR) archyviniai duomenys.', 'https://data.gov.lt/datasets/1995/'),
