INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(363, 4, 'Mirties prieastys pagal skaitmeninius medicininius mirties liudijimus', '2023-07-15', '2023-12-01', 'DUOMEN ALTINIS:\nNaudojami eSveikatos (ESPBI IS) skaitmenini medicinini mirties liudijim (forma E106) duomenys, kuriuos Registr centras kasdien teikia  Valstybs duomen agentros (VDA) Valstybs duomen valdysenos informacin sistem (VDV IS). \n\nIMTIS, APIMTIS, ATNAUJINIMAS:\nDl bet koki prieasi mir asmenys, kuri mirtis yra dokumentuota skaitmeniniame medicininame mirties liudijime (forma E106) eSveikatos sistemoje. Palikti tik valid lietuvik asmens kod (pagal struktr ir kontrolin skaitmen) mirties liudijime turintys asmenys. Pateikiamos mirtys, vykusios nuo 2018 met sausio 1 d. iki septintos dienos prie lentels atnaujinimo dat. Duomenys atnaujinami trei kiekvieno mnesio dien.\n\nLENTELS STRUKTRA:\nLentel yra agreguota pagal penkis poymius: mirties metus, mirties mnes, mirusiojo amiaus grup, lyt, nerevizuot pagrindin mirties prieast (trienkl TLK-10-AM diagnozs kod). Tad kiekviena eilut yra unikali i penki poymi kombinacija. Paskutinis stulpelis (mirusij skaiius) niekada nra lygus 0, t. y. jeigu konkreiais metais, konkret mnes, konkreioje amiaus ir lyties grupje dl konkreios prieasties nemir nei vienas asmuo - tokia eilut tiesiog nra traukiama  lentel. \n\nMIRTIES PRIEASTYS:\n Medicininio mirties liudijimo pagrindins mirties prieasties eilut gydytojo raytas TLK-10-AM kodas. \n\nPASITEIRAVIMUI:\nValstybs duomen agentros duomen atvrimo komanda: atverimas@stat.gov.lt.\n\nSVARBIOS PASTABOS: \n[1] Tai nra oficialioji mirties prieasi statistika, kuri rengia Higienos institutas. ioje lentelje mirties prieastys yra nerevizuotos, tai yra tokios, kokias jas medicininiame mirties liudijime ra sveikatos prieiros specialistas. ie raai vliau Mirties atvej ir j prieasi valstybs registre yra revizuojami ir sukoduojami ir pagal tarptautines Pasaulio sveikatos organizacijos (PSO) taisykles irenkama pagrindin mirties prieastis. Plaiau apie svokas \"pagrindin mirties prieastis\", \"tarpin mirties prieastis\" ir \"tiesiogin mirties prieastis\" skaitykite ia: https://hi.lt/uploads/pdf/padaliniai/MPR/MML_rekomendacijos.pdf. \n\n[2] iuose duomenys retais atvejais duomenys gali bti retrospektyviai atnaujinami (pvz., dl Valstybins teismo medicinos tarnybos vykdomos ekspertizs). \n\n[3] iuose duomenyse neapskaitomos perinatalins mirtys (medicininiai perinatalins mirties liudijimai, forma E106-2-1). \n\n[4] ie duomenys skirsis nuo tikslesns Higienos instituto (HI) vykdomos miri apskaitos: HI apskaito ir neskaitmeninius (\"popierinius\") medicininius mirties liudijimus, kuri gali bti apie 1%; taiau ioje lentelje yra tik skaitmeniniai medicininiai mirties liudijimai. \n\n[5] ie duomenys neymiai skirsis nuo VDA rengiamos oficialiosios mirtingumo statistikos, kurioje apskaitomi tik nuolatiniai gyventojai, o einamiesiems metams naudojama ne faktin mirties data (naudojama data, kuomet apie mirt suinota); taiau ioje lentelje  apimt gali patekti ir Lietuvos teritorijoje mir ne Lietuvos pilieiai ar asmenys, kurie nra nuolatiniai Lietuvos gyventojai, taip pat naudojama faktin mirties data. \n\n[6] Taip pat duomenyse yra paalinti mirusieji, kurie medicininiame mirties liudijime neturjo validaus lietuviko asmens kodo.', 'https://data.gov.lt/datasets/2026/'),
