(370, 42, 'EB svarbi vietovi geografin informacija u 2022 m.', '2023-07-14', '2023-10-14', 'Pateikiama informacija apie 2022 m. EB svarbes vietoves, iskiriant pagal ias kategorijas: - Medi grup, mikas - Tvenkinys su pakrants augmenija - Pdymas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Azot kaupiani augal laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Pasli laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Lauko parats, kuri plotas ir konfigracija nesikeiia 3 ir daugiau met - Trumpos rotacijos plantacijos - Griovys, kanalas nuo 1 m ploio', 'https://data.gov.lt/datasets/2343/'),
(371, 42, 'EB svarbi vietovi geografin informacija u 2021 m.', '2023-07-14', '2023-10-14', 'Pateikiama informacija apie 2019 m. EB svarbes vietoves, iskiriant pagal ias kategorijas: - Medi grup, mikas - Tvenkinys su pakrants augmenija - Pdymas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Azot kaupiani augal laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Pasli laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met - Lauko parats, kuri plotas ir konfigracija nesikeiia 3 ir daugiau met - Trumpos rotacijos plantacijos - Griovys, kanalas nuo 1 m ploio', 'https://data.gov.lt/datasets/2342/'),
(372, 42, 'EB svarbi vietovi geografin informacija u 2019 m.', '2023-07-14', '2023-10-14', 'Pateikiama informacija apie 2019 m. EB svarbes vietoves, iskiriant pagal ias kategorijas:\n- Medi grup, mikas\n- Tvenkinys su pakrants augmenija\n- Pdymas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met\n- Azot kaupiani augal laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met\n- Pasli laukas, kurio plotas ir konfigracija nesikeiia 3 ir daugiau met\n- Lauko parats, kuri plotas ir konfigracija nesikeiia 3 ir daugiau met\n- Trumpos rotacijos plantacijos\n- Griovys, kanalas nuo 1 m ploio', 'https://data.gov.lt/datasets/2340/'),
(373, 42, '2022 m. paraik geografiniai duomenys', '2023-07-14', '2023-10-14', 'Pateikiama geografin informacija (geografinis emlapis) apie 2022 m. deklaruotus paslius', 'https://data.gov.lt/datasets/2339/'),
(374, 42, '2021 m. paraik geografiniai duomenys', '2023-07-14', '2023-10-14', 'Pateikiama geografin informacija (geografinis emlapis) apie 2021 m. deklaruotus paslius', 'https://data.gov.lt/datasets/2338/'),
(375, 42, '2019 m. paraik geografiniai duomenys', '2023-07-14', '2023-10-14', 'Pateikiama geografin informacija (geografinis emlapis) apie 2019 m. deklaruotus paslius', 'https://data.gov.lt/datasets/2337/'),
(376, 36, 'Prieiros institucij paangos vertinimo duomenys', '2023-07-14', '2023-10-14', 'Duomenys, kaip kio subjekt veiklos prieir atliekanios institucijos gyvendina paangias verslo prieiros priemones ir kaip diegia su tai susietas kitas modernisias veiklos praktikas. Periodikai atliekamas tyrimas leidia stebti individuali prieiros institucij darom paang, taip pat atskleidia ir sistemines srities problemas ir prieiros veiklos organizavimo trkumus.\nDuomenys: prieiros institucijos  atliekam patikrinim (planini ir neplanini) skaiius, prieiros veiklai skirtas biudetins los, prieiros specialist skaiius, priirim kio subjekt skaiius, bendras prieiros institucij veiklos paangumo vertinimas (balais) ir detalizuojamas vertinimas pagal ias kategorijas: veiklos rodikli diegimas, rizikos vertinimas ir valdymas, kontrolini klausimyn naudojimas, patikrinim vykdymas, konsultavimo veikla, poveikio priemoni taikymas, verslo naujoko statuso taikymas, maareikmikumo instituto taikymas, bei vykdomos kio subjekt grtamojo ryio (apklaus) priemons.\nPeriodikumas  kas 2 metai.\nDaugiau informacijos apie metodik bei duomen pagrindu parengt vieslent galima rasti adresu: https://eimin.lrv.lt/lt/veiklos-sritys/verslo-aplinka/verslo-prieziuros-politika/svieslente', 'https://data.gov.lt/datasets/1698/'),
(377, 43, 'Vieojo sektoriaus svetaini atitikimo reikalavimams tyrimai', '2023-07-11', '2023-12-14', 'Valstybs ir savivaldybi institucij ir staig interneto svetaini atitikimo bendriesiems reikalavimams tyrimas. Pateikiami einamj met tyrimo rezultatai, tyrim ataskaitos.', 'https://data.gov.lt/datasets/1002/'),
(378, 38, 'KLAIPDOS RAJONO SAVIVALDYBS TERITORIJOJE DAUGIABUI NAM BENDROJO NAUDOJIMO OBJEKT ADMINISTRATORIAI', '2023-07-11', '2023-10-14', 'Jei daugiabui gyvenamj nam but ir kit patalp savininkai nesteigia bendrijos ir neinicijuoja jungtins veiklos sutarties, savivaldyb, vadovaudamasi statymais, skiria bendrojo naudojimo objekt administratori. Gyventojai administratori gali rinktis i administruojani moni srao', 'https://data.gov.lt/datasets/2336/'),
(379, 4, 'COVID-19 pandemijos duomenys', '2023-07-03', '2024-01-24', 'Lietuvos statistikos departamento rengiami COVID-19 pandemijos atvir duomen rinkiniai: sergamumas, hospitalizacijos, mirtamumas, skiepijimas, testavimas, moksleiviai, studentai, negalieji, darboviets, viesleni statistikos duomenys. Atnaujinama kasdien.', 'https://data.gov.lt/datasets/1670/'),
(380, 44, 'Biobankas', '2023-07-03', '2023-12-15', 'Biobankas  moderni aukto technologinio lygio infrastruktra, kurioje saugomi standartizuotai surinkti biologiniai mogaus mginiai ir su jais susijusi klinikin informacija, skirta Lietuvos ir pasaulio mokslinei bei industrinei bendruomenei, siekiant pltoti modernius biomedicininius tyrimus, kurti naujas gydymo bei diagnostikos priemones bei technologijas. Nacionalinio vio instituto Biobanko duomen rinkinyje pateikimi ie su miniais ar j altiniais (pacientais) susij duomenys: minio nr., pamimo data, lytis, amius, TLK-10 kodas (susirgimo kodas pagal Tarpautin lig klasifikacij (10 leidimas)), pTNM (Ligos iplitimo vertinimas pagal TNM sistem (patologinis)).', 'https://data.gov.lt/datasets/2332/'),
(381, 31, 'Mokamos sumos u medicinos priemoni (prietais) nuom', '2023-06-30', '2023-12-12', 'Informacija apie PSDF biudeto ilaidas medicinos priemoni (prietais) nuomai', 'https://data.gov.lt/datasets/2280/'),
(382, 31, 'PSDF biudeto ilaid straipsni sraas', '2023-06-30', '2023-12-12', 'Privalomojo sveikatos draudimo fondo biudeto straipsni pagal VLK direktoriaus 2005 m. birelio 30 d. sakym Nr. 1K-81 \"Dl asmens sveikatos prieiros paslaug ir sveikatos programose numatyt paslaug, u kurias mokama i Privalomojo sveikatos draudimo fondo biudeto, klasifikatoriaus patvirtinimo\" klasifikatorius', 'https://data.gov.lt/datasets/2279/'),
(383, 31, 'Stacionarins slaugos lov poreikis', '2023-06-30', '2023-12-12', 'Informacija apie metin stacionarini slaugos lov poreik pagal savivaldybes', 'https://data.gov.lt/datasets/1588/'),
(384, 31, 'Numatom teikti ambulatorini asmens sveikatos prieiros paslaug sraas, pateikiamas gydymo staig sutartyse', '2023-06-30', '2023-12-12', 'Informacija apie gydymo staig PSDF lomis teikiamas ambulatorines asmens sveikatos prieiros paslaugas (sutartyse su teritorinmis ligoni kasomis nurodyta ambulatorini asmens sveikatos prieiros paslaug nomenklatra)', 'https://data.gov.lt/datasets/1536/'),
(385, 45, 'Metini nuotek tvarkymo apskaitos ataskait duomenys', '2023-06-30', '2023-11-24', 'Metini nuotek tvarkymo apskaitos ataskait duomen rinkinyje pateikiami kio subjekt nuotek tvarkymo apskaitos metini ataskait duomenys apie kio subjekt su nuotekomis  aplink ileistus teralus, nuotek kokyb, nuotek valymo renginius, ileistuvus ir priimtuvus. Nuotek tvarkymo apskaitos metines ataskaitas kio subjektai teikia Aplinkos apsaugos agentrai per informacin sistem Aplinkos informacijos valdymo integruota kompiuterin sistema (AIVIKS), vadovaujantis Vandens naudojimo ir nuotek tvarkymo apskaitos tvarkos aprao reikalavimais.', 'https://data.gov.lt/datasets/1784/'),
(386, 31, 'DRG sraas', '2023-06-30', '2023-12-12', 'Informacija apie gimining diagnozi grupes. Kiekvien ADRG sudaro DRGs, kurios skiriasi pagal sunaudojamus iteklius. DRGs  tai detaliausias klasifikavimo lygmuo. ADRG daniausiai skirstoma  DRGs pagal gydymo atvejo klinikinio sudtingumo lygmenis.', 'https://data.gov.lt/datasets/1384/'),
(387, 31, 'Medicinini intervencij sraas (ACHI)', '2023-06-30', '2023-12-18', 'Informacija apie medicinines intervencijas. ACHI  tai Australijos medicinini intervencij klasifikacija. Jos devintasis leidimas pakeiia atuntj, ileist 2013 metais.', 'https://data.gov.lt/datasets/1383/'),
(388, 31, 'Lig sraas (TLK-10-AM)', '2023-06-30', '2023-10-22', 'Lig klasifikacija. TLK-10-AM  Tarptautin statistin lig ir sveikatos sutrikim klasifikacija, deimtasis pataisytas ir papildytas leidimas, Australijos modifikacija (TLK-10-AM)  Sisteminis lig sraas.', 'https://data.gov.lt/datasets/1259/'),
(389, 37, 'Mik sveikumo monitoringo duomenys', '2023-06-29', '2023-12-12', 'Europos mik sveikumo stebsenos programa vykdoma dviem lygiais. Pirmasis lygis dl savo regioninio pobdio vadinamas regionine mik sveikumo stebsena. Regionins mik sveikumo stebsenos tikslas - gauti operatyvi informacij apie atskir valstybi mik bkls kait teritoriniu ir laiko atvilgiu, siekiant identifikuoti oro teral tolimj perna bei kit stresini veiksni poveik mikams. Duomenys teikiami apie 200 000 medi beveik i 16 000 bareli.\nI-ojo lygio mik sveikumo monitoringo pagrindiniai vertinami rodikliai: medio ris; medio bkl, padaringumas; medio krafto klas; medio stiebo perimetras 1,3 m auktyje nuo aknies kaklelio; virns bkl; saus ak kiekis; derjimo laipsnis (puims ir eglms); spygli amius (puims); lajos paeidiamumo tipas; virutinio lajos tredalio defoliacija; visos lajos defoliacija; visos lajos dechromacija; paeidim vieta medyje; paeidim pavadinimai; paeidim intensyvumas', 'https://data.gov.lt/datasets/2306/'),
(390, 37, 'Valstybins mik apskaitos duomenys', '2023-06-29', '2023-12-12', 'Valstybins mik apskaitos tikslas  apibendrinti informacij apie miko iteklius, j kokyb, gamtin ir kin bkl. Apskaitos objektas  visi Lietuvos mikai. Apskaita atliekama kiekvien met sausio 1 d. bklei.', 'https://data.gov.lt/datasets/2305/'),
(391, 46, 'Asmen specialij poreiki duomenys', '2023-06-29', '2023-10-14', 'Specialieji poreikiai nustatomi vadovaujantis Lietuvos Respublikos socialins apsaugos ir darbo ministro ir Lietuvos Respublikos sveikatos apsaugos ministro sakymu patvirtintu Specialiojo nuolatins slaugos, specialiojo nuolatins prieiros (pagalbos), specialiojo lengvojo automobilio sigijimo ir jo techninio pritaikymo ilaid kompensacijos poreiki nustatymo tvarkos aprau, neatsivelgiant  asmens ami, negalumo lyg ar darbingumo lyg.', 'https://data.gov.lt/datasets/1820/'),
(392, 46, 'Asmen negalumo lygio duomenys', '2023-06-29', '2023-10-14', 'Negalumo lygis, vadovaujantis sveikatos apsaugos, socialins apsaugos ir darbo ir vietimo ministr sakymu patvirtintais Negalumo lygio nustatymo kriterij ir tvarkos aprau, nustatomas asmenims iki 18 met, iskyrus asmenis, kurie yra (buvo) draudiami valstybiniu socialiniu draudimu, kompleksikai vertinus asmens sveikatos bkl ir savarankikumo kasdienje veikloje ir galimybi ugdytis netekimo mast.', 'https://data.gov.lt/datasets/1816/'),
(393, 46, 'Asmen darbingumo lygio duomenys', '2023-06-29', '2023-10-14', 'Darbingumo lygis, vadovaujantis socialins apsaugos ir darbo ir sveikatos apsaugos ministr sakymu patvirtintais Darbingumo lygio nustatymo kriterij ir Darbingumo lygio nustatymo tvarkos apraais, nustatomas asmenims iki 18 met, kurie yra (buvo) draudiami valstybiniu socialiniu draudimu, ir asmenims nuo 18 met iki senatvs pensijos amiaus, kompleksikai vertinus medicininius (t. y. asmens bazin darbingum), ir asmens veiklos ir gebjim dalyvauti kriterijus.', 'https://data.gov.lt/datasets/1817/'),
(394, 3, 'Iorin reklama', '2023-06-29', '2024-01-15', 'Informacija (sraas) apie iduotus leidimus rengti iorin reklam Kaiiadori rajono savivaldybs teritorijoje', 'https://data.gov.lt/datasets/2331/'),
(395, 45, 'kio subjekt aplinkos oro taros altini ir i j imetam teral inventorizacij sraas', '2023-06-28', '2023-11-24', 'Kiekvienais metais pateikiamas atnaujintas kio subjekt, kurie atliko  aplinkos oro taros altini ir i j imetam teral inventorizacij sraas.', 'https://data.gov.lt/datasets/1789/'),
(396, 45, 'Upi kategorijos vandens telkini bkls duomenys', '2023-06-28', '2023-11-24', 'Rinkinyje pateikiama valstybinio aplinkos monitoringo duomen pagrindu arba ekspertiniu vertinimu vertinta upi kategorijos vandens telkini ekologin ir chemin bkl. Ekologin bkl nustatyta pagal fizikini-chemini, hidromorfologini ir biologini kokybs element rodiklius, vadovaujantis pavirini vandens telkini bkls nustatymo metodika. Chemin bkl nustatyta vadovaujantis Nuotek tvarkymo reglamentu.', 'https://data.gov.lt/datasets/497/'),
(397, 45, 'Eer kategorijos vandens telkini bkls duomenys', '2023-06-28', '2023-11-24', 'Rinkinyje pateikiama valstybinio aplinkos monitoringo duomen pagrindu arba ekspertiniu vertinimu vertinta eer kategorijos vandens telkini ekologin ir chemin bkl. Ekologin bkl nustatyta pagal fizikini-chemini, hidromorfologini ir biologini kokybs element rodiklius, vadovaujantis pavirini vandens telkini bkls nustatymo metodika. Chemin bkl nustatyta vadovaujantis Nuotek tvarkymo reglamentu.', 'https://data.gov.lt/datasets/1782/'),
(398, 45, 'Upi, kanal duomenys', '2023-06-28', '2023-11-24', 'Upi, kanal duomenys: unikalus identifikatorius, identifikavimo kodas, pavadinimas, vandens telkinio registravimo ir redagavimo data, vandens telkinio kategorijos pavadinimo kodas, ups pabaseinio arba baseino, kuriame yra vandens objektas, kodas, vyresniosios ups,  kuri teka ups, unikalus identifikatorius, ioi centro X ir Y koordinats LKS 94 koordinai sistemoje, tekjimo  vyresnij up krantas, ups tekjimo eilikumas, ilgis  Lietuvos teritorijoje, vidutinis daugiametis vandens debitas ups iotyse.', 'https://data.gov.lt/datasets/1779/'),
(399, 45, 'Eer, tvenkini ir dirbtini nepratekam pavirinio vandens telkini duomenys', '2023-06-28', '2023-11-24', 'Eer, tvenkini ir dirbtini nepratekam pavirinio vandens telkini duomenys: pavadinimas, registravimo data, redagavimo data, centro koordinat, vandens paviriaus plotas Lietuvos teritorijoje, identifikavimo kodas, vandens telkinio kategorijos pavadinimo kodas, eero kvadrato numeris, eero numeris kvadrate, eero ris, vandens telkinio ilgis, vidutinis plotis, kranto linijos ilgis, ups pabaseinio arba baseino, kuriame yra vandens objektas, kodas, tiesiogins ups unikalus identifikatorius, kiti duomenys.', 'https://data.gov.lt/datasets/1049/'),
(400, 47, 'Atestuot dauginamosios mediagos tiekj sraas', '2024-03-28', '2024-03-29', 'Atestuot dauginamosios mediagos tiekj sraas. Pateikiama informacija apie dauginamj mediag tiekianius kio subjektus.', 'https://data.gov.lt/datasets/2574/'),
(401, 1, 'Lietuvos Respublikos teritorijos skaitmeniniai erdviniai ems paviriaus lazerinio skenavimo tak duomenys SEP_0,5LT', '2024-03-28', '2024-03-28', 'LR teritorijos skaitmeniniai erdviniai ems paviriaus lazerinio skenavimo tak 2009-2010 m. duomenys. Tankis 0,5 tk/kv.m.', 'https://data.gov.lt/datasets/2573/'),
(402, 1, 'Lietuvos Respublikos teritorijos multispektrini ems paviriaus palydovini nuotrauk (palydovo Sentinel-2) mozaikos (sutrumpintas pavadinimas  PNM)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos teritorijos multispektrini ems paviriaus palydovini nuotrauk (Sentinel-2 palydovo) mozaikos (PNM). Duomenys teikiami .tif formatu. Europos Komisijos ir Europos Kosmoso agentros informacinje sistemoje pagal Copernicus program 2022 m. pateiktos Lietuvos Respublikos teritorij dengianios Sentinel-2 L1C lygio palydovins nuotraukos atrinktos, atlikta atmosferin korekcija ir jos apdorotos iki L2A lygio. Palydovini nuotrauk apdorojimui panaudoti automatizuoti duomen apdorojimo algoritmai, leidiantys eliminuoti subjektyvaus pobdio klaidas ir atlikti kokybik palydovini nuotrauk apdorojim. Sutvarkius palydovines nuotraukas ir transformavus jas  LKS94 (EPSG:3346) projekcij, sukomponuotos keturios atskir period visos Lietuvos Respublikos teritorijos Sentinel-2 palydovini nuotrauk mozaikos. I palydovini nuotrauk mozaik eliminuoti su sensoriumi ir palydovo judjimu susij defektai. Mozaik skiriamoji geba (pikselio dydis) ne daugiau 10 metr.', 'https://data.gov.lt/datasets/2572/'),
(403, 1, 'Lietuvos Respublikos teritorijos ems paviriaus poliarimetrini ems paviriaus palydovini nuotrauk (palydovo Sentinel-1) mozaikos (sutrumpintas pavadinimas  PNP)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos teritorijos poliarimetrini ems paviriaus palydovini nuotrauk (Sentinel-1 palydovo) mozaikos (PNP). Duomenys teikiami .tif formatu. Europos Komisijos ir Europos Kosmoso agentros informacinje sistemoje pagal Copernicus program pateiktos Sentinel-1 palydovins nuotraukos atrinktos, apdorotos ir panaudotos palydovini Sentinel-1 nuotrauk mozaik gamybai. Apdorojant Sentinel-1 palydovines nuotraukas atlikta orbitos parametr korekcija, poliarimetrinio signalo kalibravimas, elektromagnetinio signalo korekcija pagal orbitos parametrus ir reljefo formas, palydovini vaizd ortorektifikavimas bei kiti darbai. Palydovini nuotrauk sutvarkymui panaudoti automatizuoti duomen apdorojimo algoritmai. I apdorot 2022 m. sausio  lapkriio mn. laikotarpio palydovini nuotrauk sumontuota 11 atskir kiekvieno mnesio (sausio-lapkriio mn.) Sentinel-1 palydovini nuotrauk mozaik. Mozaikos skiriamoji geba (pikselio dydis) ne daugiau 10 metr.', 'https://data.gov.lt/datasets/2571/'),
(404, 48, 'Lietuvos leidjai 2023', '2024-03-28', '2024-04-15', 'Pateikiama Lietuvos leidj informacija: pavadinimas, ISBN/ISSN/ISMN pradinis nr., mons kodas, teisinis statusas, bsena, tel. nr., el. patas, svetain, vadovas.', 'https://data.gov.lt/datasets/2570/'),
(405, 1, 'Lietuvos Respublikos apskrii centr skaitmeniniai erdviniai ems paviriaus lazerinio skenavimo tak duomenys (sutrumpintas pavadinimas  SEP)', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos apskrii centr skaitmeniniai erdviniai ems paviriaus lazerinio skenavimo tak 2017 m. duomenys (sutrumpintas pavadinimas  SEP). Teikiama ASCII Simple Point Cloud (*.xyz) ir ESRI ArcGIS Binary Grid (*.adf) formatais.', 'https://data.gov.lt/datasets/2569/'),
(406, 1, 'Lietuvos Respublikos apskrii centr  skaitmeniniai erdviniai objekt paviriaus lazerinio skenavimo tak duomenys (sutrumpintas pavadinimas  SEOP)', '2024-03-28', '2024-03-28', 'Skaitmeniniai erdviniai objekt paviriaus lazerinio skenavimo tak 2017 m. duomenys (sutrumpintas pavadinimas  SEOP). Teikiama ASCII Simple Point Cloud (*.xyz) ir ESRI ArcGIS Binary Grid (*.adf) formatais.', 'https://data.gov.lt/datasets/2568/'),
(407, 1, 'Lietuvos Respublikos apskrii centr skaitmeniniai erdviniai lazerinio skenavimo tak duomenys Lidar_DR', '2024-03-28', '2024-03-28', 'Lietuvos Respublikos apskrii centr skaitmeniniai erdviniai lazerinio skenavimo tak duomenys (sutrumpintas pavadinimas  Lidar_DR) (2017 m.). LiDAR tak tankis >30 (vid. 45) tk./kv. m Tikslumas: horizontalios padties nustatymo - RMSE<30 cm, vertikalios - RMSE<10 cm. Takai klasifikuoti, 13 klasi. Priskirtos RGB reikms. Teikiama ASPRS Lidar Data Exchange (*.las) formatu.', 'https://data.gov.lt/datasets/2567/'),
(408, 1, 'Lietuvos Respublikos teritorijos M 1:5 000 skaitmeninis rastrinis ortofotografinis emlapis ORT5LT', '2024-03-27', '2024-03-27', 'Lietuvos skaitmeninis ortofotografinis M 1:5000 emlapis ORT5LT apimantis vis Lietuvos Respublikos teritorij. RMSE apie 0,4 m. Aerofotografavimas vykdytas skaitmenine fotokamera (CCD jutiklis), GSD  0,2 m.  Dl technini galimybi ir atsivelgiant  tai, kad ORT5LT tikslumas ir raika yra tokie patys, kaip ORT10LT , silome atsisiuntimui arba periros paslaugai usisakyti ORT10LT emlapius, o dl ORT5LT gavimo, praome kreiptis  Nacionalin ems tarnyb.', 'https://data.gov.lt/datasets/2565/'),
(409, 1, 'Lietuvos Respublikos teritorijos M 1:10 000 skaitmeninis rastrinis ortofotografinis emlapis ORT10LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos ortofotgrafinis emlapis M 1:10000 emlapis ORT10LT apima Lietuvos Respublikos teritorij. RMSE apie 0,4 m. Aerofotografavimas vykdytas skaitmenine fotokamera (CCD jutiklis), GSD  0,2 m. Ortofotografinius emlapius galite atsisisti atskirais lapais LizardTech MrSID bei TIFF formatais.', 'https://data.gov.lt/datasets/2564/'),
(410, 1, 'Lietuvos Respublikos teritorijos M 1:250 000  georeferencini erdvini duomen rinkinys pagal tarptautinio projekto EuroRegionalMap reikalavimus ERM_250LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:250 000 georeferencini erdvini duomen rinkinys pagal tarptautinio projekto EuroRegionalMap reikalavimus. iam projektui vadovauja EuroGeographics - Europos valstybi nacionalini kartografijos, geodezijos ir kadastro agentr asociacija.Duomen baz sudaro 8 temos: administracins ribos ir administraciniai vienetai, hidrografija (ups, eerai, tvenkiniai, jra, utvankos, altiniai, pelks ), transporto tinklas (keliai, geleinkeliai, geleinkeli stotys, degalins ir automagistrali pakels poilsio aiktels, kelt linijos, jr uostai, oro uostai, malnsparni nusileidimo aiktels, valstybins sienos kirtimo postai ), gyvenviets (ireiktos plotais ir takais), socialins temos objektai (vietimo staigos, gydymo staigos, svartynai, elektros jgains ) augmenija ir pagrindins emnaudos (mikai, dirbama em, pramoniniai sodai, atviri smlynai ir akmenynai), fizini geografini region pavadinim anotacijos (emumos, auktumos, lygumos ir pan.), vairs objektai ir orientyrai (produktotiekiai, naudingj ikasen gavybos vietos, auktos tampos perdavimo linijos, nacionaliniai parkai, policijos nuovados, laisvalaikio ir pramog parkai, populiariausi turist traukos objektai - muziejai, istoriniai pastatai, paminklai).', 'https://data.gov.lt/datasets/2563/'),
(411, 1, 'Lietuvos Respublikos teritorijos M 1:100 000 georeferencini erdvini duomen rinkinys pagal tarptautinio projekto EuroBoundaryMap reikalavimus EBM_100LT', '2024-03-27', '2024-03-27', 'Lietuvos Respublikos teritorijos M 1:100 000 georeferencini erdvini duomen rinkinys pagal tarptautinio projekto EuroBoundaryMap reikalavimus - EBM_100LT.i duomen baz yra sudaryta i administracini rib linij vektoriaus, administracini vienet plot vektoriaus bei tak vektoriaus. Linijos kaupia tam tikr atributin informacij apie rib, jos hierarchij ir kit informacij. Plotai ir takai kaupia atributin informacij apie administracini vienet hierarchij bei kodus.', 'https://data.gov.lt/datasets/2562/'),
(412, 49, ' Pabgli primimo centr atvykstantys pabgliai', '2024-04-05', '2024-04-05', 'Pabgli primimo centras (toliau  Centras) - biudetin staiga, teikianti socialines paslaugas, primim, apgyvendinim ir valstybs param:\r\n- nelydimiems nepilnameiams,\r\n- prieglobsio praytojams;\r\n- neteistai sien kirtusiems migrantams;\r\n- prekybos monmis aukoms;\r\n- perkeltiems asmenims;\r\n- prieglobsio gavjams.\r\n\r\n\r\nPabgli primimo centre tiek Rukloje, tiek Naujinink pabgli stovykloje Vilniuje priimami apgyvendinimui paeidiami asmenys:\r\nNelydimi nepilnameiai;\r\nNios moterys;\r\nAsmenys, patyr kankinimus;\r\nAsmenys, turintys psichikos sutrikim;\r\nAsmenys, turintys sveikatos sutrikim;\r\nPensinio amiaus asmenys;\r\nVienas i tv, auginantis nepilnameius vaikus;\r\neimos, auginanios nepilnameius vaikus.\r\n \r\nPagrindin Centro funkcija  gyvendinti prieglobst gavusi usieniei socialins integracijos program. Oficialus Centro atidarymas vyko 1998 m. gegus 14 d.  Per t laik Pabgli primimo centras prisidjo prie usieniei skmingos integracijos visuomenje bei darbo rinkoje.', 'https://data.gov.lt/datasets/2566/'),
(413, 9, 'ATC Lietuva - Latvija (MW)', '2024-04-15', '2024-04-15', 'Nurodomi tarpsisteminiai pralaidumai (i Lietuvos  Latvij kryptimi) prekybai dienos eigoje. Valandiniai duomenys.\r\nATC  maksimalus galimas pjvio pralaidumas (angl. Available Transfer Capacities), vertinus i anksto paskirstyt pralaidum.\r\nAtverta pagal Komisijos reglament (ES) Nr. 543/2013, 2013 m. birelio 14 d., dl duomen teikimo ir skelbimo elektros energijos rinkose, i dalies keiiantis Europos Parlamento ir Tarybos reglamento (EB) Nr. 714/2009 I pried. Daugiau informacijos: litgrid.eu', 'https://data.gov.lt/datasets/2581/'),
