(431, 4, 'Lietuvos Respublikos Seime vykusi rengini transliacij YouTube duomenys', '2024-04-15', '2024-04-16', 'Rinkinyje pateikiami duomenys apie Seime vykdytas YouTube transliacijas i komitet posdi, konferencij, spaudos konferencij, kongres, diskusij ir pan. Taip pat pateikiama informacija apie transliacijos pradios ir pabaigos laiko ymas.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2614/'),
(432, 4, 'Teiss akt registro duomenys', '2024-04-15', '2024-04-16', 'Rinkinyje pateikiami duomenys apie teiss akt registro objektus, juos parengusius ir primusius subjektus, identifikacinius kodus, objekt ris, pavadinimus ir j chronologijas (teiss akto primimo data, registravimo Registre data, paskelbimo data, sigaliojimo data, pakeitimo ar papildymo data, pripainimo netekusiu galios data, galiojimo sustabdymo data, galiojimo terminas). Registro objektai yra ie teiss aktai:\r\n1) Lietuvos Respublikos Konstitucija;\r\n2) konstituciniai statymai;\r\n3) kiti statymai;\r\n4) Lietuvos Respublikos Seimo statutas;\r\n5) Lietuvos Respublikos Seimo (toliau  Seimas) nutarimai;\r\n6) kiti Seimo priimti teiss aktai;\r\n7) Lietuvos Respublikos tarptautins sutartys;\r\n8) Respublikos Prezidento dekretai ir potvarkiai;\r\n9) Lietuvos Respublikos Vyriausybs (toliau  Vyriausyb) nutarimai, sprendimai ir rezoliucijos;\r\n10) Lietuvos Respublikos Konstitucinio Teismo (toliau  Konstitucinis Teismas) reglamentas;\r\n11) ministr, Vyriausybs staig, kit valstybs institucij ir staig vadov bei kolegiali institucij norminiai teiss aktai;\r\n12) Ministro Pirmininko potvarkiai;\r\n13) Seimo Pirmininko potvarkiai;\r\n14) Seimo valdybos sprendimai;\r\n15) Lietuvos banko norminiai teiss aktai;\r\n16) savivaldybi institucij norminiai teiss aktai, taip pat savivaldybi mer priimami teiss aktai, kuriuos skelbti Registre privaloma pagal teiss akt reikalavimus;\r\n17) galiot atlikti viej administravim asociacij, valstybs ar savivaldybs moni, viej staig, kuri savinink ar dalinink yra valstyb ar savivaldyb, valdymo organ priimti norminiai teiss aktai. Kit asociacij, valstybs ar savivaldybs moni, viej staig, kuri savinink ar dalinink yra valstyb ar savivaldyb, valdymo organ priimti teiss aktai Registro objektais yra tik tais atvejais, kai iuos teiss aktus skelbti Registre privaloma pagal teiss akt reikalavimus;\r\n18) ministr, Vyriausybs staig, kit valstybs ir savivaldybi institucij ir staig vadov ir kolegiali institucij, taip pat Lietuvos banko valdybos ar valdybos pirmininko, teiss akt nustatyta tvarka galiot atlikti viej administravim asociacij, valstybs ar savivaldybs moni, viej staig, kuri savinink ar dalinink yra valstyb ar savivaldyb, valdymo organ priimti teiss taikymo aktai, kuriuos skelbti Registre privaloma pagal teiss akt reikalavimus;\r\n19) Konstitucinio Teismo nutarimai ir sprendimai dl Konstitucinio Teismo nutarimo iaikinimo, taip pat Konstitucinio Teismo pirmininko praneimai dl ginijamo akto galiojimo sustabdymo ir dl sustabdyto akto galiojimo atnaujinimo;\r\n20) Lietuvos Aukiausiojo Teismo ir Lietuvos vyriausiojo administracinio teismo sprendimai, nutartys, nutarimai, taip pat siteisj administracini teism sprendimai dl normini administracini akt teistumo.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2613/'),
(433, 4, 'Duomenys apie Seime vykusius renginius', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seime organizuotus renginius nuo 2015m. Pateikiama informacija: renginio pavadinimas, kalba, pradios ir pabaigos laikas ir renginio vieta.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2612/'),
(434, 4, 'Inicijuoti teiss akt projektai', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie teiktus pasilymus teiss akt projektams: teiss aktus ir j atributus. Jeigu pasilymas buvo inicijuotas Seime, nurodyti ir j teikusi Seimo nari vardai ir pavards.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2611/'),
(435, 4, 'Lietuvos Respublikos Seimo kadencij ir sesij klasifikatorius', '2024-04-15', '2024-04-15', 'Lietuvos Respublikos Seimo sesij tvarkaratis. Pateikiama eilini ir neeilini sesij pradia ir pabaiga bei kadencijos, kuriai priklauso sesija, id. Lietuvos Respublikos Seimo kadencij tvarkaratis su kadencij pradios ir pabaigos datomis.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2610/'),
(436, 4, 'Lietuvos Respublikos Seimo interneto svetainje paskelbt tekst duomenys', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seimo internetiniame puslapyje paskelbtus tekstus nuo 1999m. Lietuvi, angl, vokiei, prancz ar rus kalbomis.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2609/'),
(437, 4, 'Lietuvos Respublikos Seimo vairialyps informacijos duomenys', '2024-04-15', '2024-04-15', 'Rinkinyje pateikiami duomenys apie Seimo archyvuose saugomus vaizdo, teksto ar garso artefaktus nuo XVI amiaus iki i dien. Nurodoma artefakto vieta, kategorija, apraymas, kalba, tema, pradios ir pabaigos datos (jei taikoma) ir nuoroda, jei artefakto turinys prieinamas internete.\r\n\r\nDl technini klausim ar galim klaid kreiptis  atverimas@stat.gov.lt.', 'https://data.gov.lt/datasets/2608/'),
(438, 50, 'Tvarkomos/ribojamos zonos. Telkiniai', '2024-04-11', '2024-05-03', 'Tvarkomos teritorijos, ribojamos ir reglamentuojamos zonos ir vienetai, u kuriuos atsiskaitoma duomen periros paslauga, kuriame pateikiama informacija apie su ia tema susijusias teritorijas Lietuvos Respublikoje.', 'https://data.gov.lt/datasets/2599/'),
(439, 51, 'VLKK termin banko termin duomenys', '2024-04-29', '2024-05-07', 'Valstybins lietuvi kalbos komisijos Lietuvos Respublikos termin banke kaupiami vairi srii terminai lietuvi bei kitomis Europos kalbomis, kaip vokiei, prancz, lenk. Duomenys kaupiami nuo 2005 m. ir atnaujinami kas mnes. Apimami duomenys yra patys terminai, j sritys, kalba, statusas: teiktinas, neteiktinas arba aprobuotas, vedimo data bei organizacija, pateikusi pat termin. Tarp toki organizacij patenka VLKK, Usienio reikal ministerija, Policijos departamentas.', 'https://data.gov.lt/datasets/2636/'),
(440, 4, 'Transporto priemoni rezervacijos kirsti pasien', '2024-04-25', '2024-04-26', 'Pasienio kontrols punkt direkcijos (PKPD) ir V Regitra duomen bendras rinkinys, sudarytas Valstybs duomen agentros. Duomenys kaupiami nuo 2013 m. ir atnaujinami kasdien. Duomen rinkinyje saugomas paslaugos kirsti pasien registracijos identifikatorius, registracijos kaina, mokestis ir kaina su mokesiu. Taip pat yra nurodyti atvykimo  laukimo aiktel,  pasienio kontrols punkt laikai, punkto pavadinimas bei kaimynin valstyb. Saugomas eils tipas, transporto priemons ifruotas valstybinis numeris, VIN alis, ris, kategorija, ar transporto priemon registruota Lietuvoje, ifruotas fizinio savininko arba atviras juridinio asmens kodas ir savininko pavadinimas, jei tai juridinis asmuo.', 'https://data.gov.lt/datasets/2635/'),
(441, 52, 'Pauki hemosporidiniai parazitai', '2024-04-23', '2024-04-23', 'Publikuojama informacija apie P.B ivickio Gamtos Tyrim Centro mokslini darbuotoj itirtus ir apraytus pauki hemosporidinius parazitus iplitusius po vis pasaul, iskyrus Antarktid, kurie sukelia maliarij, haemoproteoz ir kitas ligas. Informacija pateikta remiantis Lundo universiteto  MalAvi duomen baze, kuri galite rasti adresu http://130.235.244.92/Malavi/ .', 'https://data.gov.lt/datasets/2634/'),
(442, 52, 'Trematodai i Centrins ir Ryt Europos', '2024-04-23', '2024-04-23', 'Publikuojama informacija apie P.B ivickio Gamtos Tyrim Centro mokslini darbuotoj laboratorijos slygomis  tiriamus  stuburinius parazitus-siurbikes (trematodus), paplitusius Ryt ir Centrinje Europoje, bei j turtojus.', 'https://data.gov.lt/datasets/2633/'),
(443, 53, 'Nuteistj laisvs atmimo bausme statistika', '2024-04-23', '2024-05-02', 'Lietuvos kaljim tarnyba kaupia asmen, nuteist laisvs \r\natmimo bausme, statistinius duomenis nuo 2021 m., atnaujinamus kasmet, \r\ngaunamus i kalinimo staig. Rinkinys apima punkto numer, naudojam \r\natskirti atitinkamus duomenis pagal konkreius metus. Punkto numeriai \r\ngali bti pateikti tiksliau naudojant daugiau skaitmen, atskirt \r\ntakais. Tarp mint duomen patenka nusikaltimai, ivykimo i kalinimo \r\nstaigos pobdiai, nuteistj amiaus grups. Rinkinyje minti duomenys\r\nmatuojami vienetais nuteistj asmen arba metais, mnesiais ir \r\ndienomis. Patogumo dlei taip pat naudojami rinkinio eilui numeriai.', 'https://data.gov.lt/datasets/2632/');
INSERT INTO `rinkinys` (`RINKINYS_ID`, `ORGANIZACIJA_ID`, `RINKINYS_PAVADINIMAS`, `RINKINYS_IKEL_DATA`, `RINKINYS_ATNAUJ_DATA`, `RINKINYS_APRASAS`, `RINKINYS_NUORODA`) VALUES
(444, 53, 'Nuteistj areto bausme statistika', '2024-04-23', '2024-05-02', 'Lietuvos kaljim tarnyba kaupia asmen, nuteist areto \r\nbausme, statistinius duomenis nuo 2021 m., atnaujinamus kasmet, gaunamus\r\ni kalinimo staig. Rinkinys apima punkto numer, naudojam atskirti \r\natitinkamus duomenis pagal konkreius metus. Punkto numeriai gali bti \r\npateikti tiksliau naudojant daugiau skaitmen, atskirt takais. Tarp \r\nmint duomen patenka nusikaltimai, ivykimo i kalinimo staigos \r\npobdiai, nuteistj amiaus grups. Rinkinyje minti duomenys \r\nmatuojami vienetais nuteistj asmen arba metais, mnesiais ir \r\ndienomis. Patogumo dlei taip pat naudojami rinkinio eilui numeriai.', 'https://data.gov.lt/datasets/2631/'),
(445, 54, 'Savanori paraik statistika pagal priimanias organizacijas', '2024-04-23', '2024-04-26', 'Jaunimo reikal agentros Jaunimo savanorikos tarnybos sistema kaupia duomenis apie jaunimo savanoryst priimaniose organizacijose. staiga teikia duomenis, kaupiamus nuo 2018 m. Juos atnaujinti numatyta kasdien. Duomenyse kaupiama priimanios organizacijos pavadinimas ir adresas, savanorysts paraikos teikimo metai, priimt, \r\natmest prast paraik skaiiai bei j suma, paraik tapti kuratoriumi bei mentoriumi skaiiai.', 'https://data.gov.lt/datasets/2630/'),
(446, 54, 'Jaunimo darbuotoj kvalifikacija', '2024-04-23', '2024-04-23', 'Jaunimo reikal agentros Jaunimo darbuotoj sistema kaupia duomenis apie jaunimo darbuotojus. Teikiami duomenys kaupiami nuo 2018 m., numatyta atnaujinti kasdien. Duomenyse kaupiama darbuotojo ifruotas kodas, isirinkti kursai, tuometinis etatas, isilavinimas ir darboviet.', 'https://data.gov.lt/datasets/2629/'),
(447, 4, 'Nekilnojamojo turto registro but pirkim sandori informacija gardelse', '2024-04-23', '2024-04-29', 'Lentelje pateikiami agreguoti V Registr centro Nekilnojamojo turto registro (NTR) gyvenamosios paskirties objekt (but) pirkim sandori duomenys 1 km staiakampse gardelse.\r\n\r\nLentels stulpeliuose - kiekvienai gardelei apskaiiuoti sandori veri, sigyt but plot, but veri, masinio (visuotinio) vertinimo veri vidurkiai, maiausios ir didiausios verts, 10 - 90 procentiliai.\r\n\r\nLaiko aprptis - nuo 1998 m.\r\n\r\nDuomenys iame rinkinyje apima ne visus gyvenamosios paskirties objekt (but) pirkim aibs sandorius, bet tik tuos sandorius, kuri metu sigytas tik vienas objektas. Informacija apie sandorius, kuri metu buvo perkami keli objektai (pvz.: butas ir sandliukas arba butas ir ems sklypas) ioje lentelje nepateikiami.\r\n\r\nGeografin informacija (gardels) gauta i V Registr centro Adres registro. Duomenys jungiami su staiakampi 1x1 km dydio gardeli tinkl sudarytu Lietuvos valstybinje koordinai sistemoje LKS-94. Staiakamps gardels 1 km (LKS-94) https://data.gov.lt/datasets/2047/data/Grid1KmSq/?select(_id,grid_id,x_centroid,y_centroid,sav_pav,sav_kodas,geometrija)', 'https://data.gov.lt/datasets/2559/'),
(448, 48, 'Institucijos, teikianios informacij Virtualiai elektroninio paveldo sistemai (VEPIS)', '2024-04-22', '2024-04-26', 'Informacija apie staigas, teikianias informacij Virtualiai elektroninio paveldo sistemai (VEPIS) - staigos tipas, nuoroda  svetain, adresas.', 'https://data.gov.lt/datasets/2627/'),
(449, 48, 'Bibliotek ir padalini sraas', '2024-04-22', '2024-04-26', 'Informacija apie bibliotekas ir j padalinius - socialini tinkl nuoroda, nuoroda  svetain, adresas bei bibliotekos ar padalinio poymiai (pvz. ar tai edukacin institucija).', 'https://data.gov.lt/datasets/2626/'),
(450, 48, 'Bibliografiniai raai', '2024-04-22', '2024-04-26', 'Martyno Mavydo bibliotekos LIBIS IS bibliografini ra sraas.', 'https://data.gov.lt/datasets/2625/'),
(451, 48, 'Knygomatai', '2024-04-22', '2024-04-26', 'Martyno Mavydo bibliotekos  LIBIS IS  administruojami knygomatai, j adres koordinats.', 'https://data.gov.lt/datasets/2624/'),
(452, 55, 'Pacientams atlikti radiologiniai tyrimai', '2024-04-19', '2024-04-19', 'Vilniaus universiteto ligonins algirio klinikos MedDream IS kaupia duomenis apie pacientams vykdytus radiologinius tyrimus. Taikomas vienkartinis duomen, kurie kaupiami nuo 2013 met, teikimas. Duomenis papildomai numatoma atnaujinti primus sprendim dl informacins sistemos jungimo prie V Vilniaus universiteto ligonins Santaros klinikos ir pabaigus aktyviai eksploatuoti esam sistem. Duomenys apima pacient informacij: asmens kodus, gimimo metus bei lyt, tyrim informacij: modalum, studijos ir serijos apraymus, tirt paciento kno dal, fotometrin interpretacij, paskyrus gydytoj, atlikus technik, doz decigrjais kvadratiniame centimetre, apvit arksekundmis.', 'https://data.gov.lt/datasets/2623/'),
(453, 18, 'Asmens sveikatos prieiros staig aprpinimo asmenins apsaugos priemonmis ir kitomis veiklos vykdymui utikrinti btinomis priemonmis, skirtomis pasirengti ekstremalij situacij, sukelt branduolini ar radiologini avarij bei teroristini ipuoli likvidavimui duomen baz', '2024-04-18', '2024-04-25', 'Sveikatos apsaugos ministerijos Ekstremali sveikatai situacij centras (ESSC) vykdo sveikatos prieiros staig (toliau SP) aprpinimo asmens apsaugos priemonmis ir kitomis veiklos vykdymui utikrinti btinomis priemonmis, skirtomis pasirengti ekstremalij situacij, sukelt branduolini ar radiologini avarij bei teroristini ipuoli likvidavimui stebsen. \r\nDuomenys kaupiami nuo 2023 m. ir atnaujinami 1 kart per metus (spalio pabaigoje). Duomenys apima dat, nuo kada aktuals turimi duomenys, staigos ir priemons pavadinimus, priemons paskirt, iduot, panaudot, turim ir atstatyt priemons kiekius bei atstatymo dat.', 'https://data.gov.lt/datasets/2619/'),
(454, 18, 'Sveikatos prieiros staig parengties ekstremaliosioms situacijoms stebsenos duomen baz', '2024-04-18', '2024-04-25', 'Sveikatos apsaugos ministerijos  Ekstremali sveikatai situacij centras  (ESSC) koordinuoja Lietuvos nacionalins sveikatos sistemos staig pasirengim ir veikl ekstremalij situacij atvejais, vykdydamas asmens ir visuomens sveikatos prieiros staig (toliau  SP) pasirengimo veiklai ekstremalij situacij atvejais stebsen ir kaupia sveikatos prieiros staig ekstremali situacij valdymo plan vertinimus duomen bazje.\r\nDuomenys atnaujinami atnaujinami 1 kart per metus (met pradioje u prajusius metus).\r\nDuomenys apima SP pavadinim, geografin ir cenzruot el. pato adresus, apskrit, pavaldum, vertinim dat, tip ir artimiausio vertinimo metus.', 'https://data.gov.lt/datasets/2618/'),
(455, 48, 'Lietuvos leidjai', '2024-04-18', '2024-04-26', '', 'https://data.gov.lt/datasets/2617/'),
(462, 4, 'Student studij pertraukimai ir nutraukimai', '2024-04-17', '2024-04-17', 'Lentelje pateikti Nacionalins vietimo agentros (NA) student studij pertraukim / nutraukim duomenys i student registro (SR). Persidengiantys pertraukimai (pvz.: studentas pertrauk studijas 2021-09-04 - 2022-01-30 ir tuomet vl 2022-01-31 - 2022-09-01) yra sutraukti  vien laikotarp. Duomenys kaupiami nuo 2010 m.', 'https://data.gov.lt/datasets/2616/'),
(463, 4, 'Pedagog darbo krvis', '2024-04-17', '2024-04-17', 'Lentelje pateikti Nacionalins vietimo agentros (NA) pedagog (bendrojo, ikimokyklinio ugdymo mokykl, profesinio mokymo staig, neformaliojo vaik vietimo mokykl ir formalj vietim papildanio ugdymo mokykl, mokslo ir studij institucij pedagogini darbuotoj ir/arba tyrj) pareigybi ir darbo krvio duomenys i pedagog registro (PR). Duomenys kaupiami nuo 2010 m. Siekiant utikrinti asmens duomen apsaug duomenys buvo triukminti.', 'https://data.gov.lt/datasets/2615/'),
(464, 50, 'Mineraliniai itekliai', '2024-05-03', '2024-05-03', '', 'https://data.gov.lt/datasets/2646/'),
(465, 50, 'Seisminio monitoringo stotys', '2024-05-03', '2024-05-03', 'INSPIRE temos Geologija potems Geofizika duomen rinkinys, kuriame pateikiami Lietuvos Respublikos teritorijos geofizikiniai duomenys.', 'https://data.gov.lt/datasets/2645/'),
(466, 56, 'Maudykl vandens kokybs duomenys', '2024-05-03', '2024-05-03', 'Stebim Lietuvos maudykl sraas, pateikiama informacija apie:  maudymosi sezono metus, maudyklos identifikavimo unikal kod, maudymosi sezono pradi ir pabaig, vandens kokybs klas, nuorodos  maudyklos charakteristik apraus,\r\nmaudyklos stebjimo vietos koordinates, mginio mimo dat, parametr: arnini enterokok ir  arnini lazdeli vertes.', 'https://data.gov.lt/datasets/2644/'),
(467, 50, 'Lietuvos prekvartero geologinis emlapis M 1:200 000', '2024-05-03', '2024-05-03', '1999 m. revizuotame Lietuvos prekvatero geologiniame emlapyje M 1:200 000 vaizduojamos prekvartero uolien paplitimo pokvartero paviriuje geologins ribos, nuosdin dang kertantys liai ir io emlapio pagrindu sudaryt geologini pjvi linijos.', 'https://data.gov.lt/datasets/2643/'),
(468, 50, 'Lietuvos kvartero geologinis emlapis M 1:200 000', '2024-05-03', '2024-05-03', 'Kvartero geologinis emlapis rodo teritorijos paviri sudarani nuogul litologin (mediagin) sudt, genez (kilm) ir ami. Spalva emlapyje rodo nuogul kilm, o spalvos tamsumu atspindtas nuogul amius (kuo spalva tamsesn, tuo nuogulos senesns). Ami papildomai rodo ir rykios raudonos linijos, yminios: maksimal paskutiniojo Nemuno  ledyno iplitim, io ledyno Baltijos stadijos pakrat ir Baltijos stadijos ledyno Piet, Vidurio ir iaurs Lietuvos fazi ribas. Nuogul litologin sudtis paymta takiniais ir brkniniais arba kitokiais simboliais. Lietuvos kvartero geologinis emlapis apima vis Lietuvos teritorij.', 'https://data.gov.lt/datasets/2642/'),
(469, 50, 'Karstinio rajono ribos M1:50 000', '2024-05-03', '2024-05-03', 'Lietuvos karstini region rib emlapis M 1:50 000 rodo karstinio ir karstinio sufozinio proceso iplitimo ribas Lietuvos teritorijoje. Karstinis procesas Lietuvoje susijs su gipso tirpinimu ir ineimu. io proceso metu ems gelmse formuojasi tutumos, o paviriuje gali susiformuoti pavirins karstins formos  smegduobs, linkiai, griuvos ir kt. emlapis sudarytas analizuojant ir nustatant karstini reljefo form paplitim ir atsivelgiant  turim geologin informacij (karstjani uolien buvim, gipso storius, gips dengiani uolien storius ir kt.).', 'https://data.gov.lt/datasets/2641/'),
(470, 50, 'Poeminio vandens baseinai', '2024-05-03', '2024-05-03', 'Informacija apie Lietuvos poeminio vandens baseinus ir pabaseinius, basein/pabaseini kiekybin ir kokybin itekli bkl ir kiek.', 'https://data.gov.lt/datasets/2640/'),
(471, 50, 'Saugomos geriamojo vandens teritorijos', '2024-05-03', '2024-05-03', 'Geriamojo vandens apsaugos zonos, tiekimo teritorijos, apsaugos teritorijos', 'https://data.gov.lt/datasets/2639/'),
(472, 52, 'Dirvoemio temperatra ir drgm bei dirvoemyje augantys augalai', '2024-05-03', '2024-05-06', 'Publikuojama informacija apie P.B ivickio Gamtos Tyrim Centro mokslini darbuotoj tiriam dirvoemio temperatr ir drgm natraliose arba pusiau natraliose piev bendrijose Lietuvos teritorijoje nuo 2018 met. Tokie duomenys leidia tiksliau vertinti klimato kait ir kaitos padarinius augal bendrijoms lyginant su tradiciniais meteorologini stoteli kaupiamais duomenimis. Dirvoemio drgm apskaiiuojama remiantis informacija pateikta adresu https://tomst.com/web/en/systems/tms/software/  bei esania skyrelyje  TMS Calibr utility.', 'https://data.gov.lt/datasets/2638/'),
(473, 50, 'Hidrogeologinis emlapis M1:200 000', '2024-05-03', '2024-05-03', '', 'https://data.gov.lt/datasets/2637/'),
(474, 57, 'Juridini asmen duj suvartojimas', '2024-05-13', '2024-05-13', 'Rinkinyje pateikti Energijos skirstymo operatoriaus (ESO) juridini asmen duj suvartojimo duomenys. Adresai pateikiami 10 kilometr dydio staiakampmis gardelmis Lietuvos koordinai sistemoje (LKS-94). Gardels, kuriose yra 5 arba maiau vartotoj nerodomos. Duomen laiko aprptis - nuo 2019 m. sausio 1d.', 'https://data.gov.lt/datasets/2621/'),
(475, 57, 'Fizini asmen duj suvartojimas', '2024-05-13', '2024-05-13', 'Rinkinyje pateikti Energijos skirstymo operatoriaus (ESO) fizini asmen duj suvartojimo duomenys. Adresai pateikiami 1 kilometro dydio staiakampmis gardelmis Lietuvos koordinai sistemoje (LKS-94). Gardels, kuriose yra 5 arba maiau vartotoj nerodomos. Duomen laiko aprptis - nuo 2019 m. sausio 1d.', 'https://data.gov.lt/datasets/2622/');
